public class Main {

    public static int fullRec( int j ){
        if( j == 0 )
            return 0;
        if( j == 1 )
            return 1;
        return (int)Math.pow( 10, j - 1 ) + 9 * fullRec( j - 1 );
    }

    public static int rec( int num, int j ){

        if( num < 4 )
            return num * fullRec( j );
        else
            return (int)Math.pow( 10, j ) + ( num - 1 ) * fullRec( j );

    }

    public static int getFourCount( int num ){

        int[] array = new int[9];
        int fourCount = 0; 
        int i, j;

        i = 0;
        while( num != 0 ){
            array[i] = num % 10;
            num /= 10;
            i++;
        }

        for( j = i - 1; j > -1; j-- ){
            fourCount += rec( array[j], j );
        }

        return fourCount;
    }

    public static int getRealElevation( int elev ){
