	public static class Node implements Comparable<Node> {
		int adj, wei;
		Node(int a, int w) {
			adj = a;
			wei = w;
		}
		@Override 
		public int compareTo(Node other) {
			if (this.wei == other.wei)
				return 0;
			if (this.wei < other.wei)
				return -1;
			return 1;
		}

		public boolean equals(Object o) {
			if (o instanceof Node) {
				Node other = (Node)o;
				return (other.adj == this.adj && other.wei == this.wei);
			}
			return false;
		}
	}

	public static int r, c, n;
	public final static int INF = 1000000000;	
	public static int[][] dist = new int[805][805];
	public static ArrayList<ArrayList<Node>> list = new ArrayList<ArrayList<Node>>(802);

	public static void dijkstra (int source) {
		PriorityQueue<Node> minHeap = new PriorityQueue<Node>();
		boolean[] mark = new boolean[805];
		for (int i = 1; i <= r; i++) {
			dist[source][i] = INF;
			mark[i] = false;
		}
		dist[source][source] = 0;
		for (int i = 1; i <= r; i++) {
			minHeap.add(new Node(i, dist[source][i]));
		}
		for (int ver = 0; ver < r; ver++) {
			Node minAdj = minHeap.poll();
			if (mark[minAdj.adj]) {
				ver--;
				continue;
			}
			mark[minAdj.adj] = true;
			for (int i = 0; i < list.get(minAdj.adj).size(); i++) {
				if (dist[source][minAdj.adj] + list.get(minAdj.adj).get(i).wei < dist[source][list.get(minAdj.adj).get(i).adj]) {
