					//minHeap.remove(rmNode);
					dist[source][list.get(minAdj.adj).get(i).adj] = dist[source][minAdj.adj] + list.get(minAdj.adj).get(i).wei;
					minHeap.add(new Node(list.get(minAdj.adj).get(i).adj, dist[source][list.get(minAdj.adj).get(i).adj]));
				}
			}
		}
	}

	public static void main (String[] args) {
