				n = scan.nextInt();
				r = scan.nextInt();
				c = scan.nextInt();
				for (int i = 0; i < n; i++) {
					int pris = scan.nextInt();
					prisoners.add(pris);
				}

				for (int i = 0; i <= r; i++) {
					ArrayList<Node> temp = new ArrayList<Node>();
					list.add(temp);
				}

				for (int i = 0; i < c; i++) {
