public class Main {

    static int max(int a, int b) {
        return (a > b) ? a : b;
    }

    static int min(int a, int b) {
        return (a < b) ? a : b;
    }

    static int knapSack(int W, int wt[], int val[], int n) {
        int i, w;
        int[][] K = new int[3][W + 1];
        int curent = 1, prv = 0;

        for (w = 0; w <= W; w++) {
            K[0][w] = 0;
        }

        for (i = 1; i <= n; i++) {

            for (w = 0; w <= W; w++) {
                if (i == 0 || w == 0) {
                    K[curent][w] = 0;
                } else if (wt[i - 1] <= w) {
                    int temp = val[i - 1] + K[prv][w - wt[i - 1]];
                    K[curent][w] = max(temp, K[prv][w]);
                } else {
                    K[curent][w] = K[prv][w];
                }
            }
            int temp = curent;
            curent = prv;
            prv = temp;
        }

        return K[prv][W];
    }

    static int knapSack_Value(int V, int W, int wt[], int val[], int n) {
        int[][] K = new int[3][V + 1];
        int curent = 1, prv = 0;
        int res = -1, res2 = 0;
        for (int v = 0; v <= V; v++) {
            K[0][v] = v == 0 ? 0 : 999999999;
        }
        for (int i = 1; i <= n; i++) {
            for (int v = 0; v <= V; v++) {
                if (v == 0) {
                    K[curent][v] = 0;
                } else if (v < val[i - 1]) {
                    K[curent][v] = K[prv][v];
                } else {
                    int temp = wt[i - 1] + K[prv][v - val[i - 1]];
                    K[curent][v] = min(temp, K[prv][v]);
                }
            }
            int temp = curent;
            curent = prv;
            prv = temp;
        }
        for (int v = 0; v < V + 1; v++) {
            if (K[prv][v] <= W && (res2 < v || res < K[prv][v])) {
                res = K[prv][v];
                res2 = v;
            }
        }
        return res2;
    }

    public static void main(String args[]) {
        Scanner sc = new Scanner(System.in);
        while (true) {
            int n = sc.nextInt();
            int W = sc.nextInt();

            int v = 0;
            if (W == 0 || n == 0) {
                break;
            }
            int[] val = new int[n];
            for (int i = 0; i < n; i++) {
                val[i] = sc.nextInt();
                v += val[i];
            }

            int[] wt = new int[n];
            for (int i = 0; i < n; i++) {
                wt[i] = sc.nextInt();
            }

            if (W <= 50000) {
                System.out.println(knapSack(W, wt, val, n));
            } else {
                System.out.println(knapSack_Value(v,W, wt, val, n));
            }
        }
        sc.close();
    }
}

