public class Main {

	public static void main(String[] args) {

		Scanner read = new Scanner(System.in);
		ArrayList<Float> ppws = new ArrayList<Float>();
		ArrayList<Float> weights = new ArrayList<Float>();
		ArrayList<Float> profits = new ArrayList<Float>();
		int cases;
		int n;
		float k;
		float weight, profit, ppw;
		float totalProfit = 0;

		cases = read.nextInt();

		for (int i = 0; i < cases; i++) {

			ppws.clear();
			weights.clear();
			profits.clear();

			n = read.nextInt();
			k = read.nextFloat();
			totalProfit = 0;

			for (int j = 0; j < n; j++) {

				weight = read.nextFloat();
				profit = read.nextFloat();
				ppw = profit/weight;

				if(j == 0){
					ppws.add(ppw);
					weights.add(weight);
					profits.add(profit);
				}
				else
					insertion_sort(ppws, weights, profits, ppw, weight, profit);

			}

			for (int j = 0; j < n; j++) {

				if(weights.get(j) < k){
					totalProfit += profits.get(j);
					k -= weights.get(j);
				}
				else{
					totalProfit += k * ppws.get(j);
					break;
				}

			}

			totalProfit *= 100;
			totalProfit = Math.round(totalProfit);
			int temp = (int) totalProfit;
			if(temp % 100 == 0)
				System.out.println(temp/100 + ".00");
			else if(temp % 10 == 0)
				System.out.println(totalProfit/100 + "0");
			else
				System.out.println(totalProfit/100);

		}
		read.close();

	}

	public static void insertion_sort(ArrayList<Float> ppws, ArrayList<Float> amounts, ArrayList<Float> profits, float num, float amount, float profit){
		for(int i = ppws.size()-1; i >= 0; i--){

			if(num <= ppws.get(i)){
				ppws.add(i+1, num);
				amounts.add(i+1, amount);
				profits.add(i+1, profit);
				break;
			}

			if(i == 0 && num >= ppws.get(0)){
				ppws.add(0, num);
				amounts.add(0, amount);
				profits.add(0, profit);
			}

		}
	}

}

