			int n = Integer.parseInt(s);
			for (int i = 0; i < n; i++) {
				s = r.readLine();
				a = s.split(" ");
				m.ps.add(new Point(Integer.parseInt(a[0]), Integer.parseInt(a[1])));
			}
		}
