	private void DFS()
	{
		color = new int[ng];
		parent = new int[ng];
		for (int i = 0; i < ng; i++)
		{
			parent[i] = -1;
		}
		backedge = new java.util.ArrayList();

		DFSVisit(0);
	}

	private void DFSVisit(int u)
	{
		color[u] = 1; // gray

		for (int i = 0; i < graph[u].n; i++)
		{
			int v = graph[u].Ne[i];

			if (color[v] == 0) // white
			{
				parent[v] = u;
				DFSVisit(v);
			}
			else if (color[v] == 1) // gray // back edge
			{
				java.util.ArrayList list = new java.util.ArrayList();
				list.add(u);
				int w = u;
				while (parent[w] != v)
				{
					w = parent[w];
					list.add(w);
				}
				list.add(v);

				if (list.size() > 2) // if count <= 2 u and v are neighbours
				{
					backedge.add((Integer[])(list.toArray(new Integer[0])));
				}
			}
		}

		color[u] = 2; // black
	}

	private void MakeGraph(Cut[] cuts, int kx, int ky)
	{
		graph = new Node[101 * 101];
		ng = 0;

		// insert knife position as first node
		int ind1 = AddNode(kx, ky);
		int ind2;

		// insert rest of the graph nodes
		for (int c = 0; c < cuts.length; c++)
		{
			char dir = cuts[c].dir;
			for (int m = 0; m < cuts[c].len; m++)
			{
				switch (dir)
				{
					case 'U':
						ky++;
						break;
					case 'D':
						ky--;
						break;
					case 'L':
						kx--;
						break;
					case 'R':
						kx++;
						break;
				}

				ind2 = AddNode(kx, ky);
				graph[ind1].InsertNeigh(ind2);
				graph[ind2].InsertNeigh(ind1);
				ind1 = ind2;
			}
		}
	}

	private int AddNode(int x, int y)
	{
		for (int i = 0; i < ng; i++)
		{
			if (graph[i].x == x && graph[i].y == 100 - y)
			{
				return i;
			}
		}
		graph[ng++] = new Node(x, y);
		return ng - 1;
	}
}
