    public static void main(String[] args) {
        Scanner s = new Scanner(System.in);
        double n, m;
        n = s.nextDouble();
        m = s.nextDouble();
        ArrayList<distance> arr = new ArrayList<distance>();
        while (n != -1 && m != -1) {
            if(n == 0 && m == 0){
                computeRes(arr);
                arr = new ArrayList<distance>();
            }else{
                arr.add(new distance(n, m));
            }
            n = s.nextDouble();
            m = s.nextDouble();
        }
    }

    static void computeRes(ArrayList<distance> arr){
        int size = arr.size();
        double fuel=0;
        double kilometer=0;
        for (int i = 0; i < size-1; i++) {
            if(arr.get(i).fuel > arr.get(i+1).fuel){
                fuel += arr.get(i).fuel - arr.get(i+1).fuel;
                kilometer += arr.get(i+1).kilometer-arr.get(i).kilometer;
            }
        }
        double res = kilometer*arr.get(size-1).fuel/fuel;
        System.out.println(Math.round(res));
    }
}

