class TaskC {
	public void solve(int testNumber, InputReader in, PrintWriter out) {
		boolean isNotPrime[] = new boolean[33000];
		isNotPrime[0] = true;
		isNotPrime[1] = true;
		for (int i = 2; i < isNotPrime.length; i++) {
			if (!isNotPrime[i]) {
				for (int j = i * 2; j < isNotPrime.length; j += i) {
					isNotPrime[j] = true;
				}
			}
		}
		int n = in.nextInt();
		while (n != 0) {
			int res = 0;
			for (int i = 2; i < n; i++) {
				if (!isNotPrime[i] && !isNotPrime[n - i]) {
					res++;
				}
				if (i >= (n) / 2) {
					break;
				}
			}
			out.println(res);
			n = in.nextInt();
		}
	}
