	public static class Graph {

	class Node {

		//data
		public int numOfNode;
		public int color;

		public Node father;
		public ArrayList< Node > childerens;	


		public Node( int num/*data*/ ) {

			color = 0;
			father = null;
			numOfNode = num;
			childerens = new ArrayList<Node>();
		}

		public void addChild( Node c ) {
			childerens.add(c);
		}

		public Node find( int num ) {

			for (int i = 0; i < childerens.size(); i++) {

				if( childerens.get(i).numOfNode == num )
					return childerens.get(i);
			}

			return null;
		}
	}



	public Node root;
	public int partions;
	public int maximumRoom;
	public int color; 
	public int maximumRoomSize;
	public int rowOfRemovedWall;
	public int columnOfRemovedWall;
	public String directionOfRemovedWall;

	ArrayList<Integer> roomSizes = new ArrayList<Integer>();
	ArrayList<Integer> roomColors = new ArrayList<Integer>(); 

	public Graph( int numOfVertexs/*data*/ ) {

		root = new Node(0);
		partions = 0; 
		color = 1;
		maximumRoomSize = 0;

		for (int i = 1; i < numOfVertexs+1; i++) {
			root.addChild( new Node(i) );
		}

	}

	public void initialize( int[][] graphMatrix ){

		for (int i = 0; i < graphMatrix.length; i++) {
			for (int j = 0; j < graphMatrix[0].length; j++) {

				if( graphMatrix[i][j] == 1 ){
					root.find(i+1).addChild(root.find(j+1));
				}
			}			
		}

	}

	public void printGraph() {

		System.out.println("++++++------>" + root.childerens.get(0).color);


		for (int i = 0; i < root.childerens.size(); i++) {
			Node vertex = root.childerens.get(i);

			System.out.print((i)+ ": ");
			for (int j = 0; j < vertex.childerens.size(); j++) {
				System.out.print((vertex.childerens.get(j).numOfNode-1) + " " + (vertex.childerens.get(j).color) );
			}
			System.out.println();
		}
		System.out.println();
	}

	public void DFS() {



		for (int s = 0; s < root.childerens.size(); s++) {

			if ( root.childerens.get(s).color == 0 ) {
				maximumRoom = 0; 
				DFS_Visit( root.childerens.get(s) ); 
				partions++; 

				roomSizes.add(maximumRoom);
				roomColors.add(color);
				color++;
			}
		}

		maximumRoom = java.util.Collections.max(roomSizes);

	}

	public void DFS_Visit( Node s ){
		maximumRoom++;
		s.color = -1;

		for (int u = 0; u < s.childerens.size(); u++) {

			if ( s.childerens.get(u).color == 0 ) {
				DFS_Visit( s.childerens.get(u) );
				s.childerens.get(u).father = s;
			}
		}
		s.color = color;
	}

	public void calculateMaximumRoom( int[][] graphMatrix, int numOfRows, int numOfColumns ){ 

		for (int column = 0; column < numOfColumns; column++) {

			for (int row = numOfRows-1; row > -1; row--) {

				if ( returnState( row-1, column, numOfRows, numOfColumns, 1 ) ){

					int tmp = roomSizes.get( root.find( column + row*numOfColumns+1 ).color-1 ) +
							  roomSizes.get( root.find( column + (row-1)*numOfColumns+1 ).color-1) ;

					if ( tmp > maximumRoomSize ){
						maximumRoomSize = tmp;
						directionOfRemovedWall = "N";
						rowOfRemovedWall = row + 1;
						columnOfRemovedWall = column +1;
					}
				}

				if ( returnState( row, column+1, numOfRows, numOfColumns, 0 ) ) {

					int tmp = roomSizes.get( root.find( column + row*numOfColumns+1 ).color-1 ) +
							  roomSizes.get( root.find( column+1 + (row)*numOfColumns+1 ).color-1) ;

					if ( tmp > maximumRoomSize ){
						maximumRoomSize = tmp;
						directionOfRemovedWall = "E";
						rowOfRemovedWall = row + 1;
						columnOfRemovedWall = column +1;
					}
				}				

			}

		}


	}

	public boolean returnState ( int row, int column, int numOfRows, int numOfColumns, int d ) {

		if ( row < 0 || column >= numOfColumns ) return false;


		//north
		if ( d == 1 ){
			if ( root.find( column + (row)*numOfColumns+1 ).color == root.find( column + (row+1)*numOfColumns+1 ).color ) return false;
		}

		//east
		else if ( d == 0 ){
			if ( root.find( column + row*numOfColumns+1 ).color == root.find( column-1 + row*numOfColumns+1 ).color ) return false; 
		}

		return true;
	}



}



