            //initial
            courses = new ArrayList<ArrayList<Integer>>();
            checked = new ArrayList<Integer>();
            ans = new ArrayList<Integer>();

            for (int i = 0; i < n; i++) {
                ArrayList<Integer> c = new ArrayList<Integer>();
