	public static float maxsum(float[] prices, float money, int lastElement){

//		System.out.println(prices[lastElement] + " " + (money - prices[lastElement]));

		if(lastElement == -1) return 0;
		if(money - prices[lastElement] < 0) return maxsum(prices, money, lastElement-1);
		if(lastElement == 0) return prices[lastElement];

		return Math.max(
				prices[lastElement] + maxsum(prices, money-prices[lastElement], lastElement-1), 
				maxsum(prices, money, lastElement-1));
//		return sum;
	}

	public static void quickSort(float[] arr, int low, int high) {

		if (arr == null || arr.length == 0)
			return;

		if (low >= high)
			return;

		//pick the pivot
		int middle = low + (high - low) / 2;
		float pivot = arr[middle];

		//make left < pivot and right > pivot
		int i = low, j = high;
		while (i <= j) {
			while (arr[i] < pivot) {
				i++;
			}

			while (arr[j] > pivot) {
				j--;
			}

			if (i <= j) {
				float temp = arr[i];
				arr[i] = arr[j];
				arr[j] = temp;
				i++;
				j--;
			}
		}

		//recursively sort two sub parts
		if (low < j)
			quickSort(arr, low, j);

		if (high > i)
			quickSort(arr, i, high);
	}

	public static void printArray(float[] x) {
		for (float a : x)
			System.out.print(a + " ");
		System.out.println();
	}
}

