class Encode {

	String key = "";
	ArrayList<String> codes = new ArrayList<String>();
	ArrayList<String> encodeKeys = new ArrayList<String>();

	private void subtractTwoLetter ( String letter1, String letter2 ) {

		char[] charAry1 = letter1.toCharArray() ,
			   charAry2 = letter2.toCharArray() ,
			   newCharAry = new char[letter1.length()],
			   newCharAry2 = new char[letter1.length()];

		for (int i = 0; i < letter1.length(); i++) {

			int a1 = (charAry2[i] - charAry1[i]);
			if ( a1 < 0 ) a1 += 26;
			newCharAry[i] = (char)(a1 + 'a');

			int a2 = (charAry1[i] - charAry2[i]);
			if ( a2 < 0 ) a2 += 26;
			newCharAry2[i] = (char)(a2 + 'a');			
		}

		codes.add( String.valueOf(newCharAry) );
		codes.add( String.valueOf(newCharAry2) );
	}

	private void isEncodeKey ( String code ) {

		for (int i = 1; i < 6; i++) {

			boolean isKey = true;

			String temp1 = code.substring(0, i) ,
				   temp2 = code.substring(i);

			while ( temp2.length() >= temp1.length() ){

				isKey = false;

				if ( temp1.equals( temp2.substring(0, temp1.length()) ) ) {
					isKey = true;
					temp2 = temp2.substring(temp1.length());
				}

				else 
					break;

			}

			if ( isKey ) {
				if ( temp1.contains(temp2) ){
					encodeKeys.add(temp1);
					return;
				}
			}
		}

		return;
