		for (int i = 0; i < codes.size(); i++) {

			isEncodeKey( codes.get(i) );
		}

		if ( encodeKeys.size() > 0 ) key = encodeKeys.get(0);

		for (int i = 0; i < encodeKeys.size(); i++) {

			if ( encodeKeys.get(i).length() < key.length() )
				key = encodeKeys.get(i);

			else if ( encodeKeys.get(i).length() == key.length() ) {
				if ( key.compareTo(encodeKeys.get(i)) > 0 )
					key = encodeKeys.get(i);
			}
		}

	}

