    public static HashMap<String,string_graph> string_node_container = new HashMap<>();

    public static void clear_graph(){
        string_node_container.clear();
    }


    public static string_graph get_string_node(String node_string, String type){
        if (!string_node_container.containsKey(node_string)){
            string_graph root = new string_graph(node_string, type);
            string_node_container.put(node_string, root);
        }
        else{
            string_node_container.get(node_string).setNodeType(type);
        }
        return string_node_container.get(node_string);
    }

    public static void add_child_strings(string_graph root , String child_strings[]){
        for (int i = 0 ; i < child_strings.length ; i ++){

            boolean optional = false;
            if (child_strings[i].contains("?")){
                child_strings[i] = child_strings[i].substring(1);
                optional = true;
            }

            if (!string_node_container.containsKey(child_strings[i])){
                string_graph new_node = new string_graph(child_strings[i]);
                if (optional) {
                    new_node.setOptional();
                }
                else{
                    new_node.setMandatory();
                }
                string_node_container.put(child_strings[i], new_node);
                root.add_child(new_node);
            }
            else{
                if (optional){
                    string_node_container.get(child_strings[i]).setOptional();
                }
                else {
                    string_node_container.get(child_strings[i]).setMandatory();
                }
                root.add_child(string_node_container.get(child_strings[i]));
            }
        }
    }
