        if(n <= 2)
            return BigInteger.ONE;
        BigInteger a = BigInteger.ONE;
        BigInteger b = new BigInteger("2");
        for (long i = 3; i < n; i++) {
            b = b.add(a);
            a = b.subtract(a);
        }
        return b;
    }
