		int [] p = new int[a.length];
		int u, v;

		b.addLast(0);

		for (int i = 1; i < a.length; i++)
		{

			if (a[b.peekLast()] < a[i])
			{
				p[i] = b.peekLast();
				b.addLast(i);
				continue;
			}


			for (u = 0, v = b.size()-1; u < v;)
