import java.util.Arrays;
import java.util.PriorityQueue;
import java.util.Scanner;
import java.util.StringTokenizer;

public class Main
{
	public static void main(String [] args) throws IOException
	{
		Scanner scanner = new Scanner(System.in);

		while(true)
		{
			int v = scanner.nextInt();
			int e = scanner.nextInt();

			int [][] graph = new int[v][v];
			for(int i = 0 ; i < e ; i++)
			{
				StringTokenizer st = new StringTokenizer(scanner.next(), "(, )");
				for(int j = 0 ; st.hasMoreElements() ; j++)
				{
					int a = Integer.parseInt(st.nextToken());
					int b = Integer.parseInt(st.nextToken());

					graph[a][b] = ++graph[b][a];
					e--;
				}
				e++;
			}
			int [][][] tmp =new int[v][v][v];
			for(int i = 0 ; i < v ; i++)
				tmp[i] = copy(graph, v);

			int res = Integer.MAX_VALUE/2;

			for(int i = 1 ; i < v ; i++)
					res = Math.min(res, Max_Flow.find(tmp[i], i, 0));

			System.out.println(v <= 1 ? 0 : res);
		}
	}

	private static int[][] copy(int[][] graph, int v)
	{
		int [][] res = new int[v][v];

		for(int i = 0 ; i < v ; i++)
			for(int j = 0 ; j < v ; j++)
				res[i][j] = graph[i][j];

		return res;
	}
}
class Max_Flow
{
	public static int find(int[][] graph, int SOURCE, int SINK)
	{
		int res = 0;
		int tmp;
		while ((tmp = path(graph, SOURCE, SINK)) != 0) res += tmp;
		return res;
	}

	private static int path(int[][] graph, int source, int sink)
	{
		int n = graph.length;
		int[] value = new int[n];
		int[] prev = new int[n];
		boolean[] visited = new boolean[n];
		Arrays.fill(prev, -1);

		PriorityQueue<Node> queue = new PriorityQueue<Node>();
		queue.add(new Node(source, Integer.MAX_VALUE/2));
		value[source] = Integer.MAX_VALUE/2;

		while (!queue.isEmpty())
		{
			Node at = queue.poll();
			if(visited[at.at]) continue;
			visited[at.at] = true;
			if(at.at == sink) break;

			for(int i = 0;i < n;i++)
				if(graph[at.at][i] != 0)
					if(!visited[i])
						if(value[i] < Math.min(value[at.at], graph[at.at][i]))
						{
							value[i] = Math.min(value[at.at], graph[at.at][i]);
							prev[i] = at.at;
							queue.add(new Node(i, value[i]));
						}
		}

		if(prev[sink] == -1) return 0;
		int at = sink;
		while (at != source)
		{
			graph[prev[at]][at] -= value[sink];
			graph[at][prev[at]] += value[sink];
			at = prev[at];
		}
		return value[sink];
	}

	static class Node implements Comparable<Node>
	{
		int at;
		int flow;

		public Node(int a, int b)
		{
			at = a;
			flow = b;
		}

		public int compareTo(Node a)
		{
			return a.flow-flow;
		}
	}
}

