{
	public static void main(String[] args) throws Exception
	{
		Scanner scanner = new Scanner(System.in);
		while(true)
		{
			double x = scanner.nextDouble();
			double y = scanner.nextDouble();
			double r = scanner.nextDouble();
			if(r < 0)
				break;

			int n = scanner.nextInt();

			Point [] points = new Point[n];
			for(int i = 0 ; i<n; i++)
				points[i] = new Point(scanner.nextInt(), scanner.nextInt());

			double [] radii = new double[n];

			for(int i =0 ; i<n ; i++)
			{
				double vx = points[i].x - x;
				double vy = points[i].y - y;
				radii[i] = Math.atan2(vy, vx);
				if(radii[i] < 0)
					radii[i] = 2*Math.PI + radii[i];
				if(dis(points[i].x, points[i].y, x, y) > r)
					radii[i] = 100;

			}

			Arrays.sort(radii);

			int res = 0;
			Queue<Double> queue = new LinkedList<Double>();
			for(int i = 0 ; i<2*n ; i++)
			{
				double radius;
				if(i < n)
					radius = radii[i];
				else
					radius = radii[i%n] + 2*Math.PI;
				if(radius >= 100)
					continue;

				queue.offer(radius);

				while(radius - queue.peek() > Math.PI)
					queue.poll();
				res = Math.max(res, queue.size());
			}
			System.out.println(res);

		}
	}

	private static double dis(double x, double y, double x1, double y1)
	{
		return Math.sqrt((x1 - x)*(x1 - x) + (y1 - y)*(y1 - y));
	}
}

