import java.util.LinkedList;
import java.util.Queue;
import java.util.Scanner;

/**
 * Created by ali on 10/16/14.
 */
public class Main
{
	private final static int [] dx = new int[] { 1, 2, 1, 2,-1,-2,-1,-2};
	private final static int [] dy = new int[] { 2, 1,-2,-1, 2, 1, -2,-1};
	private static long [][][] dp = new long[1000][10][10];

	public static void main(String [] args)
	{
		Scanner in = new Scanner(System.in);


		while(in.hasNext())
		{

			String a = in.next();
			String b = in.next();

			int[] p1 = get(a);
			int[] p2 = get(b);

			for(long [][] fill1 : dp)
				for(long [] fill2 : fill1)
					Arrays.fill(fill2, -1);

			int res = bfs(p1[0], p1[1], p2[0], p2[1]);

			System.out.println("To get from "+a+" to "+b+" takes "+res+" knight moves.");
		}
	}

	private static int[] get(String a)
	{
		int [] res = new int[2];
		res[0] = a.charAt(0)-'a';
		res[1] = a.charAt(1) - '1';

		return res;
	}

	private static int bfs(int x1, int y1, int x2, int y2)
	{
		int [][] best = new int[8][8];
		for(int [] fill : best)
			Arrays.fill(fill, 1000000000);

		Queue<Integer> queue = new LinkedList<Integer>();
		queue.offer(x1);
		queue.offer(y1);
		best[x1][y1] = 0;

		while(!queue.isEmpty())
		{
			int ax = queue.poll();
			int ay = queue.poll();
			for (int d = 0; d < 8; d++)
			{
				int tx = ax + dx[d];
				int ty = ay + dy[d];

				if (tx < 0 || ty < 0 || tx >= 8 || ty >= 8)
					continue;

				if(best[tx][ty] != 1000000000)
					continue;

				queue.offer(tx);
				queue.offer(ty);

				best[tx][ty] = best[ax][ay] + 1;
			}
		}

		return best[x2][y2];
	}
}

