import java.util.ArrayList;
import java.util.Arrays;
import java.util.Scanner;

public class Main {
    private String name;
    private boolean optional;
    private int type; //0 -> + , 1 -> | , 2 -> ^
    private int typeCnt; // the minimum number of sub feature for type = 0
    private ArrayList<Main> childes;
    public static void main(String[] args) {
        String command;
        Scanner scanner = new Scanner(System.in);
        while (true){
            command = scanner.nextLine();
            if (command.equals("###"))
                break;
            command = command.replaceAll("\\s+","");// cleaning the white spaces
            String[] coffeeMachine = command.split("=");
            Main root = new Main(coffeeMachine[0]); // root of the tree

            ArrayList<String[]> commands = new ArrayList<>(); // a list of all represents commands
            commands.add(coffeeMachine);
            while (true){//gathering all the commands in cmds
                command = scanner.nextLine();
                command = command.replaceAll("\\s+","");
                if (command.equals("#"))
                    break;

                String[] temp2 = command.split("=");//separating the feature from its sub features

                commands.add(temp2);
            }
            add(commands, root);//creating the graph

            while (true){// validation
                command = scanner.nextLine();
                if (command.equals("##")){
                    System.out.println("+++");
                    break;
                }
                check(command, root);
            }
        }
    }

    private static void check(String configuration, Main root) {// validation of c
        configuration = configuration.replaceAll("\\s+","");
        configuration = configuration.substring(1, configuration.length() -1);//removing { } from the beginning and the end of the command
        String[] namesArr = configuration.split(",");

        ArrayList<String> names = new ArrayList<>(Arrays.asList(namesArr));// turning the array into arraylist

        if (root.validation(names) && names.size() == 1 && names.get(0).equals(root.getName()))// check the validation of the given configuration and also check whether the only remaining feature is the root of the graph or not
            System.out.println("Valid");
        else
            System.out.println("Invalid");
    }

    private static void add(ArrayList<String[]> representations, Main root) {// forming the tree from represents commands
        int i = 0;
        Main r;
        while (representations.size() > 0){
            r = root.search(representations.get(i)[0]);// check if the laft side of the represent command exists in the graph
            if (r != null){
                if (representations.get(i)[1].contains("+")){// check the type of the command
                    r.addEdge(representations.get(i)[1].split("\\+"), 0);// seperating the sub features with ",", and adding them to the graph
                }
                else if (representations.get(i)[1].contains("|")){
                    r.addEdge(representations.get(i)[1].split("\\|"), 1);
                }
                else if (representations.get(i)[1].contains("^")){
                    r.addEdge(representations.get(i)[1].split("\\^"), 2);
                }
                representations.remove(i);
                i -= 1;
            }
            i += 1;
            if (i >= representations.size())// check whether the commands are over or not
                i = 0;
        }
    }


    public Main(String name) {
        if (name.charAt(0) == '?') {
            this.optional = true;
            name = name.substring(1);//removing the ? from the name
        }
        this.name = name;
        childes = new ArrayList<>();
    }

    public boolean validation(ArrayList<String> names) {
        //DFS implementation of validation
        if (childes.size() == 0)// if this node does not have any child return true
            return true;

        boolean[] visit = new boolean[childes.size()]; // which one of the children are visited

        int nVisited = 0; // the number of visited children
        for (int i = 0; i < childes.size(); i++) {
            for (int j = 0; j < names.size(); j++) {
                if (childes.get(i).getName().equals(names.get(j))){ // searching for every child
                    names.remove(j);
                    visit[i] = true;
                    if(!childes.get(i).isOptional()) // does not count optional children
                        nVisited += 1;
                    break;
                }
            }
        }

        if (this.type == 0 && nVisited == typeCnt || this.type == 1 && nVisited > 0 || this.type == 2 && nVisited == 1){ // type = 0 -> it must visit all the mandatory children, type = 0 -> it must visit at least one children, type = 2 -> it must visit exactly one child
            for (int i = 0; i < childes.size(); i++) {
                if (visit[i] && !childes.get(i).validation(names))// if this child is visited, validate its sub features.
                    return false;
            }
            return true;//if every child is valid then return true = valid
        }
        return false;
    }

    public Main search(String name){
        // find the node with given name and return it recursively
        if (this.name.equals(name)) {
            return this;
        }
        for (Main child: this.childes) {
            Main m = child.search(name);
            if (m != null)
                return m;
        }
        return null;
    }

    public void addEdge(String[] children, int type) {
        // add given children and set the type
        typeCnt = 0;
        this.type = type;
        for (String s : children) {
            Main temp = new Main(s);
            this.childes.add(temp);
            if (s.charAt(0) != '?')// it only count mandatory children
                typeCnt += 1;
        }
    }

    public String getName() {
        return name;
    }

    public boolean isOptional() {
        return optional;
    }
