public class Main{
	public static void main(String[] args) {
		Scanner scanner = new Scanner(System.in);
		int t = scanner.nextInt();
		for (int i = 0; i < t; i++) {
			int n = scanner.nextInt();
			double sum = 0;
			for (int j = 0; j < n; j++) {
				sum += scanner.nextInt();
			}
			double avg = sum / n;

			double count = n;
			for (int j = 2; j <= n; j++) {
				double s = tarkib(j, n) * fact(j);
				count += s;
				sum +=s * (avg * j);
			}

			System.out.println(new DecimalFormat("0.000000").format(sum / count));
		}
	}

	private static long tarkib(int r, int n) {
		return fact(n) / (fact(n - r) * fact(r));
	}

	private static long fact(long t) {
		long f = 1;
		for (int i = 2; i <= t; i++)
			f *= i;
		return f;
	}
}

