}


class Check {
    public static TreeNode search(TreeNode root, String feature) {
        if (root.getFeature().equals(feature))
            return root;
        for (int i = 0; i < root.getChildren().size(); i++) {
            if (root.getChildren().get(i) != null
            && search(root.getChildren().get(i), feature) != null)
                 return search(root.getChildren().get(i), feature);
        }
        return null;
    }

    public static boolean containParent (TreeNode root, List<String> testCase) {
        for (int i = 0; i < testCase.size(); i++) {
            TreeNode node = search(root, testCase.get(i));
            if (node != null
                    && node.getParent() != null
                    && !testCase.contains(node.getParent().getFeature()))
                return false;
        }

        return true;
    }

    public static boolean containChildrenMatchingTypeRule (TreeNode root, List<String> testCase) {
        if (root.getParent() == null) {
            if (!testCase.contains(root.getFeature()))
                return false;
        }
        if (root.getChildrenType() == ChildrenType.MAN) {
            for (int i = 0; i < root.getChildren().size(); i++) {
                if (!root.getChildren().get(i).optional) {
                    if (!testCase.contains(root.getChildren().get(i).getFeature())) {
                        return false;
                    }
                    if (!containChildrenMatchingTypeRule(root.getChildren().get(i), testCase)) {
                        return false;
                    }
                } else {
                    if (testCase.contains(root.getChildren().get(i).getFeature())) {
                        if (!containChildrenMatchingTypeRule(root.getChildren().get(i), testCase)) {
                            return false;
                        }
                    }
                }
            }
        } else if (root.getChildrenType() == ChildrenType.OR) {
            boolean or = false;
            for (int i = 0; i < root.getChildren().size(); i++) {
                if (testCase.contains(root.getChildren().get(i).getFeature())) {
                    or = true;
                    if (!containChildrenMatchingTypeRule(root.getChildren().get(i), testCase)) {
                        return false;
                    }
                }
            } if (!or) return false;
        } else if (root.getChildrenType() == ChildrenType.ALT) {
            int count = 0;
            for (int i = 0; i < root.getChildren().size(); i++) {
                if (testCase.contains(root.getChildren().get(i).getFeature())) {
                    count++;
                    if (count > 1) return false;
                    if (!containChildrenMatchingTypeRule(root.getChildren().get(i), testCase)) return false;
                }
            }
            if (count == 0) return false;
        }
        return true;
    }

    static public boolean validFeature(TreeNode root, List<String> testCase) {
        boolean thereIs = false;
        for (String s : testCase) {
            if (search(root, s) == null) {
                return false;
            }
            thereIs = true;
        }
        return thereIs;
    }
}

enum ChildrenType {
    OR,
    ALT,
    MAN;
}

interface ChildType {
    public ChildrenType getType();

    public void setType(ChildrenType childrenType);

    public boolean isType(TreeNode treeNode);
}

class InputTree {

    public static void setOptional(List<List<TreeNode>> treeNodeStructure) {
        for (List<TreeNode> treeNodes : treeNodeStructure) {
            for (TreeNode treeNode : treeNodes) {
                if (treeNode.getFeature().substring(0, 1).equals("?")) {
                    Parse.questionMarkRemover(treeNode);
                    treeNode.optional = true;
                }
            }
        }
    }

    public static void insertFeatures(List<List<String>> structure, List<List<TreeNode>> treeNodeStructure) {
        for (List<String> list : structure) {
            treeNodeStructure.add(TreeNode.toTreeNode(list));
        }
    }

    public static void insertParents(List<List<TreeNode>> treeNodeStructure) {
        for (List<TreeNode> treeNodes : treeNodeStructure) {
            for (int j = 1; j < treeNodes.size(); j++) {
                treeNodes.get(j).setParent(treeNodes.get(0));
            }
        }
    }

    public static void insertChildren(List<List<TreeNode>> treeNodeStructure) {
        for (int i = 0; i < treeNodeStructure.size(); i++) {
            TreeNode root = treeNodeStructure.get(i).get(0);
            for (int j = 0; j < treeNodeStructure.size(); j++) {
                for (int k = 1; k < treeNodeStructure.get(j).size(); k++) {
                    if (treeNodeStructure.get(j).get(k).getFeature().equals(root.getFeature())) {
                        treeNodeStructure.get(j).get(k).setChildren(root.getChildren());
                    }
                }
            }
        }
    }

    public static void insertTypes(TreeNode root) {
        if (!root.getFeature().equals("+")
            || !root.getFeature().equals("=")
            || !root.getFeature().equals("|")
            || !root.getFeature().equals("^"))
            root.setChildrenType(TreeNode.defineType(root));
        for (int i =0; i < root.getChildren().size(); i++){
            if (root.getChildren().get(i) != null) {
                insertTypes(root.getChildren().get(i));
            }
        }
    }

    public static void traverseAndRemove(TreeNode root) {
        Parse.structurePunctuationRemover(root);
        for (int i =0; i < root.getChildren().size(); i++){
            if (root.getChildren().get(i) != null) {
                traverseAndRemove(root.getChildren().get(i));
            }
        }
    }

    public static TreeNode findRoot(List<List<TreeNode>> treeNodeStructure) {
        TreeNode root = new TreeNode();
        boolean isRoot = true;
        for (int i = 0; i < treeNodeStructure.size(); i++) {
            root = treeNodeStructure.get(i).get(0);
            for (List<TreeNode> treeNodes : treeNodeStructure) {
                for (int k = 1; k < treeNodes.size(); k++) {
                    if (treeNodes.get(k).getFeature().equals(root.getFeature())) {
                        isRoot = false;
                        break;
                    }
                    if (!isRoot)
                        break;
                }
            }
            if (isRoot) return root;
            isRoot = true;
        }
        return root;
    }

    public TreeNode toTree(List<List<String>> structure) {

        List<List<TreeNode>> treeNodeStructure = new LinkedList<>();

        insertFeatures(structure, treeNodeStructure);

        setOptional(treeNodeStructure);

        insertParents(treeNodeStructure);

        insertChildren(treeNodeStructure);

        insertTypes(findRoot(treeNodeStructure));

        traverseAndRemove(findRoot(treeNodeStructure));

        return findRoot(treeNodeStructure);
    }

}

