	public static void MergeSort(point[] ps, point[] temp, int left, int right, int flag){
		if(right>left){
			int mid=(right+left)/2;
			MergeSort(ps,temp,left,mid,flag);
			MergeSort(ps,temp,mid+1,right,flag);
			merge(ps,temp,left,mid+1,right,flag);
		}
	}

	public static void merge(point[] ps, point[] temp, int left, int mid, int right, int flag){

		int left_end=mid-1;
		int t=left;
		int num=right-left+1;
		while((left<=left_end)&&(mid<=right)){
			if(flag==0){
				if(ps[left].x<=ps[mid].x)
					temp[t++]=ps[left++];
				else
					temp[t++]=ps[mid++];
			}
			else{
				if(ps[left].y<=ps[mid].y)
					temp[t++]=ps[left++];
				else
					temp[t++]=ps[mid++];
			}
		}
		while(left<=left_end)
			temp[t++]=ps[left++];
		while(mid<=right)
			temp[t++]=ps[mid++];
		for(int y=0;y<num;y++){
			ps[right]=temp[right];
			right=right-1;
		}
	}

	public static double ClosestPairDistance(point[] x_ordered, point[] y_ordered){
		double d_min=0;
		double d_min_sq=1000000;
		double dl=0,dr=0;
		int n=x_ordered.length;
		if(n<=3){
			for(int u=0;u<n;u++){
				int v=u+1;
				while(v<n){
					d_min_sq=Math.min(d_min_sq,(Math.pow(x_ordered[u].y-x_ordered[v].y,2))+(Math.pow(x_ordered[u].x-x_ordered[v].x,2)));
					v++;
				}
			}
