				mid=n/2;
			else
				mid=n/2+1;
			point[] x_l=new point[mid+1];
			point[] x_r=new point[n-mid+1];
			point[] y_l=new point[mid+1];
			point[] y_r=new point[n-mid+1];
			System.arraycopy(x_ordered,0,x_l,0,mid+1);
			System.arraycopy(x_ordered,mid-1,x_r,0,n-mid+1);
			System.arraycopy(y_ordered,0,y_l,0,mid+1);
			System.arraycopy(y_ordered,mid-1,y_r,0,n-mid+1);
			dl=ClosestPairDistance(x_l,y_l);
			dr=ClosestPairDistance(x_r,y_r);
			d_min=Math.min(dl,dr);
			Vector<point> S=new Vector<point>();
			double m=x_ordered[mid-1].x;
			for(int a=0;a<y_ordered.length;a++)
				if(Math.abs((y_ordered[a].x)-m)<d_min)
					S.add(y_ordered[a]);
			d_min_sq=Math.pow(d_min,2);
