				int v=u+1;
				while((v<S.size())&&((Math.pow(S.elementAt(v).y-S.elementAt(u).y,2))<=d_min_sq)){
					d_min_sq=Math.min(d_min_sq,(Math.pow(S.elementAt(v).x-S.elementAt(u).x,2))+(Math.pow(S.elementAt(v).y-S.elementAt(u).y,2)));
					v++;
				}
			}
		}
		return Math.sqrt(d_min_sq);
	}

}

