	public static void sortInt(ArrayList<Integer> values) {
		if (values.size()>1){
			mergesortInt(values,0, values.size()- 1);
		}
	}

	private static void mergesortInt(ArrayList<Integer> values, int low, int high) {
		// check if low is smaller then high, if not then the array is sorted
		if (low < high) {
			// Get the index of the element which is in the middle
			int middle = (high+low) / 2;
			// Sort the left side of the array
			mergesortInt(values,low, middle);
			// Sort the right side of the array
			mergesortInt(values,middle + 1, high);
			// Combine them both
			mergeInt(values,low, middle, high);
		}
	}

	private static void mergeInt(ArrayList<Integer> values, int low, int middle, int high) {

		int[] helper = new int[values.size()];

		// Copy both parts into the helper array
		for (int i = low; i <= high; i++) {
			helper[i] = values.get(i);
		}

		int i = low;
		int j = middle + 1;
		int k = low;
		// Copy the smallest values from either the left or the right side back
		// to the original array
		while (i <= middle && j <= high) {
			if (helper[i] <= helper[j]) {
				values.set(k, helper[i]) ;
				i++;
			} else {
				values.set(k, helper[j]); 
				j++;
			}
			k++;
		}
		// Copy the rest of the left side of the array into the target array
		while (i <= middle) {
			values.set(k,helper[i] )  ;
			k++;
			i++;
		}

	}

