class HeapTree{
	public ArrayList<Integer> elements;
	public ArrayList<Integer> VValues;
	public Map<Integer,Integer> positions;
	int last;
	public HeapTree(int cap) {
		elements = new ArrayList<Integer>();
		VValues = new ArrayList<Integer>();
		positions = new HashMap<Integer,Integer>();
		last = 0;
		elements.clear();
		VValues.clear();
		positions.clear();
		for(int i = 0; i <= cap; i++){
			elements.add(0);
			VValues.add(0);
			//positions.add(0);
		}
	}
	public void insert(int key,int vval){
		last ++ ;
		elements.set(last,key);
		positions.put(vval,last);
		VValues.set(last,vval);
		//increaseKey(1);
		decreaseKey(vval, key);
	}
	public void decreaseKey(int v, int newVal){
		int pos = positions.get(v);
		elements.set(pos,newVal);
		//positions.put(newVa,pos);
		while (pos / 2 > 0 && elements.get(pos/2) > elements.get(pos))
		{
			int parentpos = pos/2;
			positions.put(VValues.get(parentpos),pos);
			positions.put(VValues.get(pos),parentpos);
			int tmp = elements.get(parentpos);
			elements.set(parentpos,elements.get(pos));
			elements.set(pos,tmp);

			tmp = VValues.get(parentpos);
			VValues.set(parentpos,VValues.get(pos));
			VValues.set(pos,tmp);
			pos= parentpos;
		}
	}
	public void increaseKey(int pos){
		while ((pos * 2 <= last && elements.get(pos*2) < elements.get(pos)) || (pos*2+1<= last && elements.get(pos*2+1) < elements.get(pos)))
		{
			int childpos;
			if (pos*2+1 <= last && elements.get(pos*2+1) <elements.get(pos*2))
				childpos = pos*2+1;
			else
				childpos = pos*2;
			positions.put(VValues.get(childpos),pos);
			positions.put(VValues.get(pos),childpos);
			Integer tmp = new Integer(elements.get(childpos));
			elements.set(childpos,elements.get(pos));
			elements.set(pos,tmp);

			tmp = VValues.get(childpos);
			VValues.set(childpos,VValues.get(pos));
			VValues.set(pos,tmp);
			pos  = childpos;
		}
	}

	public boolean empty(){
		if(last <= 1) return true;
		return false;
	}
	public Integer extractMin(){
		int res = VValues.get(1);
		//System.out.println("last " + last);
		//System.out.println("elements.get(last): " + elements.get(last));
		elements.set(1,elements.get(last));
		positions.put(VValues.get(last),1);
		VValues.set(1,VValues.get(last));
		last --;
		increaseKey(1);
		return res;
	}
}
