                    visit[i] = true;
                    if(!childes.get(i).isOptional()) // does not count optional children
                        nVisited += 1;
                    break;
                }
            }
        }

        if (this.type == 0 && nVisited == typeCnt || this.type == 1 && nVisited > 0 || this.type == 2 && nVisited == 1){ // type = 0 -> it must visit all the mandatory children, type = 0 -> it must visit at least one chldren, type = 2 -> it must visit exactly one child
            for (int i = 0; i < childes.size(); i++) {
                if (visit[i] && !childes.get(i).validation(names))// if this child is visited, validate its sub features.
                    return false;
            }
            return true;//if every child is valid then return true = valid
        }
        return false;
    }

    public Main search(String name){
        // find the node with given name and return it recursively
        if (this.name.equals(name)) {
            return this;
        }
        for (Main child: this.childes) {
            Main m = child.search(name);
            if (m != null)
                return m;
        }
        return null;
    }

    public void addEdge(String[] children, int type) {
        // add given children and set the type
        typeCnt = 0;
        this.type = type;
        for (String s : children) {
            Main temp = new Main(s);
            this.childes.add(temp);
            if (s.charAt(0) != '?')// it only count mandatory children
                typeCnt += 1;
        }
    }

