class DisjointSet {

	int[] parent;
	int size;
	int[] gsize;
	int[] w;

	public DisjointSet(int n) {
		parent = new int[n];
		gsize = new int[n];
		w = new int[n];
		for (int i = 0; i < n; i++) {
			parent[i] = i;
			size = n;
			gsize[i] = 1;
		}
	}

	public int find(int i) {
		while (i != parent[i])
			i = parent[i];
		return i;
	}

	public void union(int i, int j) {
		int p = find(i);
		int q = find(j);
		if (p != q) {
			if (w[p] > w[q]) {
				parent[q] = p;
				gsize[p] += gsize[q];
				gsize[q] = 0;
			} else if (w[q] > w[p]) {
				parent[p] = q;
				gsize[q] += gsize[p];

			} else {
				parent[q] = p;
				gsize[p] += gsize[q];
				gsize[q] = 0;
				w[p]++;
			}
			size--;
		}
	}

}

