class Liquid{
    double weight;
    double cost;
    double costDivideByWeight;
    Liquid(double w,double c) {
        weight = w;
        cost = c;
        costDivideByWeight = c / w;
    }
}
public class Main {
    ArrayList<Liquid> knapsack = new ArrayList<Liquid>();
    void readInput(){
        int t;
        int n;
        double k;
        double a;
        double p;
        Scanner input = new Scanner(System.in);
        t = input.nextInt();
        for(int i = 0;i < t;i++){
            n = input.nextInt();
            k = input.nextDouble();
            for(int j = 0;j < n;j++){
                a = input.nextDouble();
                p = input.nextDouble();
                knapsack.add(new Liquid(a,p));
            }
            sort();
            KnapsackGreedy(k);
            knapsack.clear();
        }
    }
    void sort(){
        for(int i = 1;i < knapsack.size();i++){
            double key = knapsack.get(i).costDivideByWeight;
            int index = i;
            Liquid mount = new Liquid(knapsack.get(index).weight,knapsack.get(index).cost);
            int j = i - 1;
            while(j > -1 && knapsack.get(j).costDivideByWeight > key){
                knapsack.set(j + 1,knapsack.get(j));
                j--;
            }
            knapsack.set(j + 1,mount);
        }
    }
    void KnapsackGreedy(double u){
        double value = 0;
        double weight = u;
        for(int i = knapsack.size() - 1;i > -1;i--){
             if(knapsack.get(i).weight <= weight){
                weight = weight - knapsack.get(i).weight ;
                value += knapsack.get(i).cost;
            }
            else{
                double r = weight / knapsack.get(i).weight;
                value += r * knapsack.get(i).cost;
                break;
            }
        }
        setPrecision(value);
    }
    void setPrecision(double d){
        BigDecimal bd = new BigDecimal(d).setScale(2, RoundingMode.HALF_EVEN);
        d = bd.doubleValue();
        DecimalFormat df = new DecimalFormat("#0.00");
        System.out.println(df.format(d));
    }
    public static void main(String[] Args){
        Main m = new Main();
        m.readInput();
    }
