import java.util.ArrayList;
import java.util.Scanner;

class Meeting {

	public int startTime;
	public int finishTime;
	public int isChosen;

	public Meeting( int start, int finish ){

		startTime = start;
		finishTime = finish;

		isChosen = 0;

	}

	public boolean checkInterference(	Meeting meeting ){

		if( 
			((startTime < meeting.startTime)  && (meeting.startTime < finishTime))  ||
			((startTime < meeting.finishTime) && (meeting.finishTime < finishTime)) ||
			((startTime > meeting.startTime)  && (meeting.finishTime > startTime))  ||
			((finishTime > meeting.startTime) && (meeting.finishTime > finishTime)) ||
			((startTime ==  meeting.startTime) && (finishTime == meeting.finishTime))
		  ){ return true; }


		return false;

	}

}

class MeetingDay {

	public ArrayList<Meeting> meetingsOfDay;
	public ArrayList<Integer> acceptedMeetings;

	public MeetingDay(){

		meetingsOfDay = new ArrayList<Meeting>();
		acceptedMeetings = new ArrayList<Integer>();

	}

	public void convertSubsetNumToBits( int subSetNum ){

		int q = subSetNum;
		int r, counter = 0;
		int size = meetingsOfDay.size();
		do{

			r = (q%2);
			q = (q/2);

			meetingsOfDay.get( size - counter - 1 ).isChosen = r;
			counter++;

		}while( q != 0 );

		if( counter > (size - 1) )
			meetingsOfDay.get( 0 ).isChosen = r;

	}

	public boolean NoInterferenceBetweenSubsets(){

		int size = meetingsOfDay.size();
		for( int i=0; i< size; i++ ){

			Meeting first = meetingsOfDay.get(i); 
			if( first.isChosen == 1 ){
				for( int j=0; j< size; j++ ){

					if( j == i )continue;

					Meeting second = meetingsOfDay.get(j);
					if( second.isChosen == 1 ){

						if( first.checkInterference( second ) )
							return false;
					}

				}

			}

		}

		return true;

	}

	public int NumOfOnes(){

		int num = 0;
		for( int i=0; i< meetingsOfDay.size(); i++ )
			if( (meetingsOfDay.get(i).isChosen) == 1 )
				num++;

		return num;

	}

	public int findSubsetWithMaxOnes(){

		int maxNum = acceptedMeetings.get(0);

		for( int i=1; i<acceptedMeetings.size(); i++ ){

			int tempNum = acceptedMeetings.get(i);
			if( tempNum >= maxNum )
				maxNum = tempNum;

		}

		return maxNum;

	}

	public int findNumOfAcceptedMeetings() {

		int numOfSubSets = (int) Math.pow( 2.0, meetingsOfDay.size() );
		for( int i=0; i<numOfSubSets; i++ ){

			convertSubsetNumToBits( i );

			if( NoInterferenceBetweenSubsets() )
				acceptedMeetings.add( NumOfOnes() );

		}

		return findSubsetWithMaxOnes();

	}

}

public class Main {


	public static void main(String[] args) {

		Scanner in = new Scanner( System.in );

		int numOfDays = Integer.valueOf( in.next() );

		for( int day=0; day<numOfDays; day++ ){

			MeetingDay newDay = new MeetingDay();

			int start  = Integer.valueOf( in.next() );
			int finish = Integer.valueOf( in.next() );
			while( true ){

				if( (start != 0) || (finish != 0) ){

