class comp implements Comparator<Rect>{

    @Override
    public int compare(Rect o1, Rect o2) {
        if((o1.xmax-o1.xmin)*(o1.ymax-o1.ymin) < (o2.xmax-o2.xmin)*(o2.ymax-o2.ymin))
            return 1;
        else if((o1.xmax-o1.xmin)*(o1.ymax-o1.ymin) > (o2.xmax-o2.xmin)*(o2.ymax-o2.ymin))
            return -1;
        else
            return 0;
    }

} 
class Rect implements Comparable<Rect> {

    int xmin, xmax, ymin, ymax;

    public Rect(int xmin, int xmax, int ymin, int ymax) {
        this.xmin = xmin;
        this.xmax = xmax;
        this.ymin = ymin;
        this.ymax = ymax;
    }

    @Override
    public int compareTo(Rect o) {
        if (xmin >= o.xmin && xmax <= o.xmax && ymin >= o.ymin && ymax <= o.ymax) {
            return -1;
        } else {
            return 1;
        }
    }
}

class Bst {

    public void BST_Insert(Node p, Rect x) {
        Node n = new Node(x, null, null, null);
        Node prep = null;
        Node r = p;
        while (r != null) {
            prep = r;
            if (x.compareTo(r.element) == -1) {
                r = r.left;
            } else if (x.compareTo(r.element) == 1) {
                r = r.right;
            }
        }
        n.parent = prep;
        if (prep == null) {
            r = n;
        } else if (x.compareTo(prep.element) == -1) {
            prep.left = n;
        } else {
            prep.right = n;
        }
    }

    public int count(Node root) {
        int count = 0;
        Node r = root;
        while (r != null) {
            if (r.left != null) {
                count += countTree(r.left);
                if (r.element.xmin == r.left.element.xmin && r.element.xmax == r.left.element.xmax
                        && r.element.ymin == r.left.element.ymin && r.element.ymax == r.left.element.ymax) {
                    count++;
                }
            }
            r = r.right;
        }
        return count;
    }

    public int countTree(Node root) {
        if (root == null) {
            return 0;
        }
        if (root.left == null && root.right == null) {
            return 1;
        }
        return countTree(root.left) + countTree(root.right) + 1;
    }
}

