	private static MyResult optimumScore(int[] arr, int p_one, int p_two) {
		if (p_one == p_two) {
			int right = sumarr(arr, p_one + 1, arr.length);
			int left = sumarr(arr, 0, p_one);

			return right >= left ? new MyResult(arr[p_one] + right, left) : new MyResult(arr[p_one] + left, right);
		}

		if (p_one < p_two) {
			int mid = (p_one + p_two) / 2;
			return new MyResult(sumarr(arr, 0, mid + 1), sumarr(arr, mid + 1, arr.length));
		} else {
			int mid = (p_one + p_two) / 2 + ((p_one + p_two)%2 == 0 ? 0 : 1);
			return new MyResult(sumarr(arr, mid, arr.length), sumarr(arr, 0, mid));
		}
	}

	private static int sumarr(int[] arr, int begin, int end) {
		int sum = 0;
		if (begin >= arr.length || end < 0)
			return 0;
		for (int i = begin; i < end; i++)
			sum += arr[i];
		return sum;
	}


}

