class F {

    void Solve(Scanner in, StringBuilder sb) {
        int hour = 0, minute = 0;
        while (true) {
            String str = in.next();
            if (str.equals("###")) {
                hour--;
                minute += 60;
                hour += (minute / 60);
                minute %= 60;
                sb.append(String.format("%d:%02d%n", hour, minute));
                break;
            }
            if (str.equals("$$$")) {
                hour--;
                minute += 60;
                hour += (minute / 60);
                minute %= 60;
                sb.append(String.format("%d:%02d%n", hour, minute));
                hour = 0;
                minute = 0;
                continue;
            }
            str = str.replace('.', ':');
            int sign = str.charAt(0) == '+' ? 1 : -1;
            int h = 0;
            int m = 0;
            try {
                h = Integer.parseInt(str.substring(1, str.indexOf(':')));
            } catch (Exception e) {
                h = 0;
            }

            try {
                m = Integer.parseInt(str.substring(str.indexOf(':') + 1));
            } catch (Exception e) {
                m = 0;
            }

            hour += (h * sign);
            minute += (m * sign);
        }
    }
}

