            String str = "";
            for (int j = 0; j < m; j++) {
                int tmp = s.nextInt();
                str += createString(tmp - leftCounter);
                leftCounter = tmp;
                str += ")";
            }
            Node[] arr = createArray(str);
            Stack<Node> stack = new Stack();
            String res = "";
            for (int j = 0; j < arr.length; j++) {
                if (arr[j].str == ')') {
                    int c=0;
                    Node tmp = stack.pop();
                    for (int k = tmp.Place; k < arr[j].Place; k++) {
                        if(arr[k].str == '(')
                            c++;
                    }
                    res += (arr[j].Place - tmp.Place - c + 1) + " ";
                } else {
                    stack.push(arr[j]);
                }
            }
            System.out.println(res.trim());
        }
    }

    static String createString(int num) {
        String res = "";
        for (int i = 0; i < num; i++) {
            res += "(";
        }
        return res;
    }

    static Node[] createArray(String str) {
        Node[] stack = new Node[str.length()];
        for (int i = 0; i < str.length(); i++) {
            stack[i] = new Node(i, str.charAt(i));
        }
        return stack;
    }
}

