import java.util.ArrayList;
import java.util.Scanner;

class node{
	public node(){};
	public ArrayList<child> child = new ArrayList<child>();
	public String name;
	public int dis;
	public boolean visited = false;
}

class child {
	public child(){};
	public String nameCh;
	public int vertex;
}

public class Main {

	public static ArrayList<node> nodesOfGraph = new ArrayList<node>();
	public static ArrayList<node> q = new ArrayList<node>();

	public static int nodeIs(ArrayList<node> temp, String nodeName){
		for (int i = 0; i < temp.size(); i++) {
			if(temp.get(i).name.contentEquals(nodeName) == true)
				return i;
		}
		return -1;
	}

	public static void makeGraph(String fa, String ch, int v) {

		int index = nodeIs(nodesOfGraph, fa);			//find father or create father
		if (index != -1) {
			child tmp = new child();
			tmp.nameCh = ch;
			tmp.vertex = v;
			nodesOfGraph.get(index).child.add(tmp);
		}
		else{
			if (nodesOfGraph.isEmpty() == true) {
				node tempnode = new node();
				tempnode.name = fa;
				tempnode.dis = Integer.MAX_VALUE;
				nodesOfGraph.add(tempnode);

				child tmp = new child();
				tmp.nameCh = ch;
				tmp.vertex = v;
				nodesOfGraph.get(0).child.add(tmp);
			}else{
				node tempnode = new node();
				tempnode.name = fa;
				tempnode.dis = Integer.MAX_VALUE;
				nodesOfGraph.add(tempnode);

				child tmp = new child();
				tmp.nameCh = ch;
				tmp.vertex = v;
				nodesOfGraph.get(nodesOfGraph.size()-1).child.add(tmp);}
		}
		index = nodeIs(nodesOfGraph, ch);			//find child or create child
		if (index != -1) {
			return;
		}
		else{
			node tempnode = new node();
			tempnode.name = ch;
			tempnode.dis = Integer.MAX_VALUE;
			nodesOfGraph.add(tempnode);
		}
	}

	public static void updateNodes (int indexfather){
		int indextmp, tmp;
		for (int i = 0; i < nodesOfGraph.get(indexfather).child.size(); i++) {
			indextmp = nodeIs(nodesOfGraph, nodesOfGraph.get(indexfather).child.get(i).nameCh);
			if( (nodesOfGraph.get(indexfather).dis + nodesOfGraph.get(indexfather).child.get(i).vertex) <= nodesOfGraph.get(indextmp).dis ){
				nodesOfGraph.get(indextmp).dis = nodesOfGraph.get(indexfather).dis + nodesOfGraph.get(indexfather).child.get(i).vertex;

			}
			tmp = nodeIs(q, nodesOfGraph.get(indextmp).name) ; 
			if ( (tmp == -1) ) {
				if ( (nodesOfGraph.get(indextmp).visited != true) ) {
					nodesOfGraph.get(indextmp).visited = true;
					q.add( nodesOfGraph.get(indextmp) );
				}
			}
		}
	}

	public static int findMin(){
		int index = 0;
		if(q.size() == 0)
			return -1;
		else if (q.size() == 1)
			return index;
		else{
			for (int i = 0; i <= (q.size()-1); i++) {
				if ( i == q.size()-1) {
					return index;
				}

				if ( q.get(i).dis >= q.get(i+1).dis ) {
					index = i+1;
				}
			}
			return index;
		}
	}

	public static int dijkstra(String source, String destination){
		int index = nodeIs(nodesOfGraph, source);
		nodesOfGraph.get(index).dis = 0;
		q.add( nodesOfGraph.get(index) );
		updateNodes (index);
		q.remove(0);

		while(q.isEmpty() == false){
			index = findMin();
			if (q.get(index).name.contentEquals(destination) == true) {
				return q.get(index).dis;
			}
			else{
				int minInGraph = nodeIs(nodesOfGraph, q.get(index).name);
				updateNodes(minInGraph);
				q.remove(index);
			}
		}
		return -1000;
	}

	public static void defaultDistance(){
		for (int i = 0; i < nodesOfGraph.size(); i++) {
			nodesOfGraph.get(i).dis = Integer.MAX_VALUE;
		}
	}

	public static void main(String[] args) {

		Scanner input = new Scanner(System.in);

		int minOfDis = Integer.MAX_VALUE;
		String source;
		String destination;
		String fatmp;
		String chtmp;
		int vertmp, vertex;

		while ( input.hasNext() ) {
			minOfDis = Integer.MAX_VALUE;
			source = input.next();
			destination = input.next();
			vertex = input.nextInt();
			for (int i = 0; i < vertex; i++) {
				fatmp = input.next();
				chtmp = input.next();
				vertmp = input.nextInt();
				makeGraph(fatmp, chtmp, vertmp);
			}

			int vertexOfChild;
			for (int i = 0; i < nodesOfGraph.size(); i++) {
				for (int j = 0; j < nodesOfGraph.get(i).child.size(); j++) {
					vertexOfChild = nodesOfGraph.get(i).child.get(j).vertex;
					nodesOfGraph.get(i).child.get(j).vertex = 0;
					int tempOfDijkstra = dijkstra(source, destination);
					if ( minOfDis > tempOfDijkstra ) {
						minOfDis = tempOfDijkstra;
					}
					nodesOfGraph.get(i).child.get(j).vertex = vertexOfChild;
					defaultDistance();
					q.clear();
					for (int k = 0; k < nodesOfGraph.size(); k++) {
						nodesOfGraph.get(k).visited = false;
					}
				}
			}
			System.out.println(minOfDis);
			q.clear();
			nodesOfGraph.clear();
		} // end of while
//		System.out.println();
	}

}

