import java.io.BufferedOutputStream;
import java.io.BufferedReader;
import java.io.FileNotFoundException;
import java.io.IOException;
import java.io.InputStreamReader;
import java.io.PrintWriter;
import java.util.Arrays;
import java.util.StringTokenizer;

/**
 *
 * @author Mbt925
 * sample: 2 1 2 1 1 2 1 2
 * mods by 4: 0:2 1:2 2:3 3:2
 * when mods change two times from 1 to 1, it means sum of numbers in thing range is definitely equals to 4
 * when mods change three times from 2 to 2, it means there are two ranges which their sum is 4, of course they are contiguous, so their sum will be dividable by 4 too.
 */
public class Main {

    /**
     * @param args the command line arguments
     * @throws java.io.FileNotFoundException
     */
    public static void main(String[] args) throws FileNotFoundException, IOException {
        new Solve().solve();
    }
}

class Solve {
    final int MAXN= 50000;
    final int MAXD= 1000000;
    int[] cumSums= new int[MAXN+1];
    int[] modsCounts= new int[MAXD];
    public void solve() throws FileNotFoundException, IOException{
        BufferedReader reader= new BufferedReader(new InputStreamReader(System.in));
        PrintWriter writer= new PrintWriter(new BufferedOutputStream(System.out));

        int t= Integer.parseInt(reader.readLine());

        for (int i = 0; i < t; i++) {
            StringTokenizer tokenizer= new StringTokenizer(reader.readLine());
            int d= Integer.parseInt(tokenizer.nextToken());
            int n= Integer.parseInt(tokenizer.nextToken());
            // cumulative sum
            tokenizer= new StringTokenizer(reader.readLine());
            cumSums[0]=0;
            for (int j = 1; j <= n; j++){
                cumSums[j]=cumSums[j-1]+Integer.parseInt(tokenizer.nextToken());
                cumSums[j]%=d;
            }
            // count mod by each number
            modsCounts[0]=1;
            for (int j = 1; j <= n; j++)
                modsCounts[cumSums[j]]++;
            // count sequences
            long count=0;
            for (int j = 0; j < d; j++) {
                if (modsCounts[j]>=2)
                    count += (long)modsCounts[j]*(modsCounts[j]-1)/2;
            }
            writer.println(count);

            Arrays.fill(cumSums, 0);
            Arrays.fill(modsCounts, 0);
        }
        writer.flush();
    }
}

