		BufferedReader in = new BufferedReader(red);
		try {
			int T = Integer.parseInt(in.readLine());
			ArrayList<Long> outputs = new ArrayList<Long>();

			for (int k = 0; k < T; k++) {
				String[] line = in.readLine().trim().split(" ");
				ArrayList<Long> inputs = new ArrayList<Long>();
				for (int i = 0; i < line.length; i++) {
					inputs.add(Long.parseLong(line[i]));
				}
				long output = -1;
				for (int i = 0; i < line.length; i++) {
					for (int j = i + 1; j < line.length; j++) {
						output = max(output, bmm(inputs.get(i), inputs.get(j)));
					}
				}

				outputs.add(output);
			}

			for (int k = 0; k < T; k++) {
				System.out.println(outputs.get(k));
			}
		} catch (IOException a) {
			System.out.println("");

		} catch (Exception a) {
			System.out.println("");
		} finally {
			in.close();
		}
	}

	public static long max(long a, long b) {
		if (a > b)
			return a;
		else
			return b;
	}

	public static long bmm(long a, long b) {
		if (a == 0)
			return b;

		if (b == 0)
			return a;

		if (a == 1 || b == 1)
			return 1;

		if (a == b)
			return a;

		long min = a;
		long max = b;

		if (b < a) {
			min = b;
			max = a;
		}

		while (min > 1) {
			if (max % min == 0)
				return min;

			long t = max;
			max = min;
			min = t % min;
		}

		return 1;
	}

}

