        if (pointsSortByX.length <= 3) {
            return GetNearest(pointsSortByX);
        }

        int mid = pointsSortByX.length / 2;
        Point[] leftPoints, rightPoints, leftPointsSortByY, rightPointsSortByY;
        leftPoints = Arrays.copyOfRange(pointsSortByX, 0, mid);

        leftPointsSortByY = leftPoints.clone();
        Arrays.sort(leftPointsSortByY, new ArrayComparator(Dimension.Y, true));

        rightPoints = Arrays.copyOfRange(pointsSortByX, mid , pointsSortByX.length);
        rightPointsSortByY = rightPoints.clone();
        Arrays.sort(rightPointsSortByY, new ArrayComparator(Dimension.Y, true));

        double leftDistance = ClosestProblem(leftPoints, leftPointsSortByY);
        double rightDistance = ClosestProblem(rightPoints, rightPointsSortByY);

        List<Point> temp = new ArrayList<Point>();
        double shortestDistance = leftDistance < rightDistance ? leftDistance : rightDistance;
        double centerX = rightPoints[0].getX();
        for (Point point : pointsSortByY) {
