    }

    public static FeatureType typeOf(String delimiter) {
        for (FeatureType featureType : FeatureType.values())
            if (delimiter.equals(featureType.delimiter))
                return featureType;
        return SIMPLE; // default, to get rid of NPE warnings
    }
