class PerimeterCalculator {

	public String[][] shape;
	public int[][] check;

	public int rows,columns;

	public int perimeter = 0;


	public void calculate( int i, int j ) {

		check[i][j] = 1;

		//up
		if ( ((i-1 > -1) && shape[i][j].contains("X") && check[i-1][j] == -1) || !(i-1 > -1) ) perimeter++;

		//right
		if ( (( j+1 < columns ) && shape[i][j].contains("X") && check[i][j+1] == -1) || !(j+1 < columns)  ) perimeter++;


		//left
		if ( (( j-1 > -1 ) && shape[i][j].contains("X") && check[i][j-1] == -1) ||  !( j-1 > -1 ) ) perimeter++;

		//down
		if (  (( i+1 < rows ) && shape[i][j].contains("X") && check[i+1][j] == -1) || !( i+1 < rows ) ) perimeter++;




		if ( i-1 > -1 ){
			// up

			if ( check[i-1][j] == 0 ) { check[i-1][j] = 1; calculate ( i-1, j ); }

			else if ( check[i-1][j] == 1 );
		}



		if ( j+1 < columns ) {
			//right

			if ( check[i][j+1] == 0 ){ check[i][j+1] = 1; calculate ( i, j+1 ); }

			else if ( check[i][j+1] == 1 );	
		}


		if ( j-1 > -1 ) {
			//left

			if ( check[i][j-1] == 0 ){ check[i][j-1] = 1; calculate ( i, j-1 ); }

			else if ( check[i][j-1] == 1 );		
		}


		if ( i+1 < rows ){
			//down

			if ( check[i+1][j] == 0 ){check[i+1][j] = 1; calculate ( i+1, j ); }

			else if ( check[i+1][j] == 1 );				
		}


		if ( i-1 > -1 && j+1 < columns  ) {	
			//up-right

			if ( check[i-1][j+1] == 0 ){ check[i-1][j+1] = 1; calculate ( i-1, j+1 ); }

			else if ( check[i-1][j+1] == 1 );	
		}


		if ( i-1 > -1 && j-1 > -1 ) {	
			//up-left

			if ( check[i-1][j-1] == 0 ){ check[i-1][j-1] = 1; calculate ( i-1, j-1 ); }

			else if ( check[i-1][j-1] == 1 );	
		}


		if ( i+1 < rows && j+1 < columns ){	
			//down-right

