            Integer[][] f = new Integer[s + 1][s + 1];//f[i][j]=>the smallest number of coins for reaching the (i,j) value;

            for (int i = 0; i <= s; i++) {

                for (int j = 0; j <= s; j++) {
                    if (i == 0 && j == 0) {
                        f[i][j] = 0;
                    } else {
                        int tmp = Integer.MAX_VALUE;
                        for (int c = 0; c < coins.size(); c++) {
                            Coin coin = (Coin) coins.get(c);
                            int ii = i - coin.GetX();
                            int jj = j - coin.GetY();
                            if ((ii >= 0) && (jj >= 0)) {
