			Customer [] customers = new Customer[cnt];
			for(int i = 0 ; i < cnt ; i++)
			{
				StringTokenizer tokenizer = new StringTokenizer(reader.readLine());
				int time = getTime(tokenizer.nextToken());
				int x1 = Integer.parseInt(tokenizer.nextToken());
				int y1 = Integer.parseInt(tokenizer.nextToken());
				int x2 = Integer.parseInt(tokenizer.nextToken());
				int y2 = Integer.parseInt(tokenizer.nextToken());

				customers[i] = new Customer(time, x1, y1, x2, y2);
			}

			boolean [][] graph = new boolean[cnt][cnt];

			for(int i = 0 ; i < cnt ; i++)
				for(int j = i+1 ; j < cnt ; j++)
					if(customers[i].time + customers[i].distance() + customers[i].distance(customers[j]) < customers[j].time)
						graph[i][j] = true;

			int need = cnt;
			int [] match = new int[cnt];
			Arrays.fill(match, -1);

			for(int i = 0 ; i < cnt ; i++)
				if(matching(i, graph, new boolean[cnt], match))
					need--;

			writer.println(need);
		}

		writer.flush();
		writer.close();
	}

	private static boolean matching(int at, boolean[][] graph, boolean[] visited, int[] match)
	{
		if(visited[at])
			return false;
		visited[at] = true;

		for(int i = at+1 ; i < graph.length ; i++)
			if(graph[at][i])
				if(match[i] == -1 || matching(match[i], graph, visited, match))
				{
					match[i] = at;
					return true;
				}

		return false;
	}

	private static int getTime(String time)
	{
		return Integer.parseInt(time.substring(0, 2))*60 + Integer.parseInt(time.substring(3));
	}

	static class Customer
