    public Feature(String name){

        this.name = name;
    }

    public String name_getter() { return this.name;}


    public static int name_finder(String[] string_to_evaluate , String name){
        for(int temp=0 ; temp< string_to_evaluate.length ; temp++)
        {
            if(string_to_evaluate[temp].equals(name))
                return temp;
        }
        return -1;
    }

    static Feature feature_finder (LinkedList<Feature_defenition> feature_defenition, String name)
    {
        for (int temp=0 ; temp < feature_defenition.size() ; temp++) {
            if (feature_defenition.get(temp).feature_components_name[0].equals(name))
            {
                if (feature_defenition.get(temp).feature_type.equals("mandatory"))
                    return(Mandatory_feature.mandatory_maker(feature_defenition , temp));
                else if (feature_defenition.get(temp).feature_type.equals("or"))
                    return(Or_feature.Or_maker(feature_defenition, temp));
                else
                    return (Xor_feature.Xor_maker(feature_defenition, temp));
            }
        }
        return null;
    }
    static void feature_defention_deleter(LinkedList<Feature_defenition> feature_defenition, String name) {
        for (Feature_defenition defenition : feature_defenition) {
            if (defenition.feature_components_name[0].equals(name))
            {
                feature_defenition.remove(defenition);
                break;
            }
        }
    }
}


