public class Main {

    public static void main(String[] args) {
        String answers = "";
        Scanner line = new Scanner(System.in);
        String newLine = line.nextLine();

        while ( !(newLine.equals("###") ) ){
            List<Feature> features = new ArrayList<Feature>();
            List<String> names = new ArrayList<String>();

            while ( !(newLine.equals("#") ) ){
                    newLine = newLine.trim().replaceAll("\\s+", "");

                    String firstName = newLine.split("=")[0].trim().replaceAll(" +", "");
                   int index = processFirst(firstName, names, features);
                    processChildren(newLine, names, features, index);
                    features.get(index).setChildType(setDivider(newLine));

                    newLine = line.nextLine();
                }
            newLine = line.nextLine();

            while ( !(newLine.equals("##") ) ){
                resetUsedChildren(features);
                List<String> testCase = new ArrayList<String>();
                List<Feature> testFeatures = new ArrayList<Feature>();

                boolean Invalid = getTestCase(newLine, names, features, testCase, testFeatures);

                if (Invalid){
                    answers+=("Invalid\n");
                    newLine = line.nextLine();
                    break;
                }

                Invalid = true;

                Invalid = rootCheck(Invalid, testCase, testFeatures);

                Invalid = mandatoryCheck(Invalid, testCase, testFeatures);

                countChildren(testFeatures);
                Invalid = childrenCheck(Invalid, testFeatures);

                Invalid = parentCheck(Invalid, testFeatures);

                if (Invalid){
                    answers += "Invalid\n";
                } else answers += "Valid\n";

                newLine = line.nextLine();
            }
            answers += "+++\n";
            newLine = line.nextLine();
        }
        System.out.print(answers);
    }

    static String setDivider(String newLine){
        if (newLine.contains("+")){
            return  "\\+";
        } else if (newLine.contains("|")){
            return  "\\|";
        } else if (newLine.contains("^")){
            return  "\\^";
        }
        return "";
    }

    static int processFirst(String firstName, List<String> names, List<Feature> features){
        if (names == null || names.indexOf(firstName) == -1 ){
            names.add(firstName);
            Feature first = new Feature(firstName);
            features.add(first);
        }
        return names.indexOf(firstName);
    }

    static void processChildren(String newLine, List<String > names, List<Feature> features, int index){
        String[] children;
        children = newLine.split("=")[1].split(setDivider(newLine));

        for (String name: children) {
            String editedName = name.contains("?") ? name.substring(1) : name;
            if (names.indexOf(editedName) == -1) {
                names.add(((editedName)).trim().replaceAll("\\s+", ""));
                features.add(new Feature(name));
            }
            features.get(index).setChild(features.get(names.indexOf((editedName))));
            if (name.contains("?")) features.get(names.indexOf(name.substring(1))).optional = true;
        }
    }

    static void resetUsedChildren(List<Feature> features){
        for (Feature f: features) {
            f.childUsedCount = 0;
        }
    }

    static boolean getTestCase(String newLine, List<String> names, List<Feature> features, List<String> testCase, List<Feature> testFeatures){
        boolean Invalid = false;
        for (String x:
                newLine.trim().replaceAll("\\{","").trim().replaceAll("}", "").trim().replaceAll("\\s+","").split(",")
        ) {
            testCase.add(x);
            if (names.indexOf(x) != -1)
                testFeatures.add(features.get(names.indexOf(x)));
            else Invalid = true;
        }
        return Invalid;
    }

    static boolean rootCheck(boolean Invalid, List<String> testCase, List<Feature> testFeatures){
        for (int index = 0; index < testCase.size() && Invalid; index++){
            if ( testFeatures.get(index).parent == null ) Invalid = false;
        }
        return Invalid;
    }

    static boolean mandatoryCheck(boolean Invalid, List<String> testCase, List<Feature> testFeatures){
        for (int index = 0; index < testFeatures.size() && !Invalid; index++){
            for (Feature feature: testFeatures.get(index).children
            ) {
                if ( feature.parentRelType == 1 && testFeatures.indexOf(feature) == -1 ){
                    Invalid = true;
                }
                if (Invalid) break;
            }
        }
        return Invalid;
    }

    static void countChildren(List<Feature> testFeatures){
        for (Feature feature: testFeatures) {
            if (feature.parent != null)
                feature.parent.childUsedCount++;
        }
    }

    static boolean childrenCheck(boolean Invalid, List<Feature> testFeatures){
        for (Feature feature: testFeatures) {
            if ((feature.childRelType == 1 && feature.childUsedCount != 1)) {
                Invalid = true;
                break;
            }
            if (feature.childRelType == 2 && feature.childUsedCount < 1){
                Invalid = true;
                break;
            }
        }
        return Invalid;
    }

    static boolean parentCheck(boolean Invalid, List<Feature> testFeatures){
        for (Feature feature: testFeatures) {
            if (feature.parent != null){
                if (testFeatures.indexOf(feature.parent) == -1){
                    Invalid = true;
                    break;
                }
            }
        }
        return Invalid;
    }

}
class Feature {
    public String name;
    public List<Feature> children;
    public Feature parent;
    public boolean optional = false;
    public int childUsedCount = 0;
    public int childRelType = 0;
    public int parentRelType = 0;

    public Feature(String name){
        if (name.contains("?")) {
            this.optional = true;
            name = name.substring(1);
        }
        this.setName(name);
        this.children = new ArrayList<Feature>();
    }

    public void setChildType(String divider) {
        if (divider == "\\^") {
            this.childRelType = 1;
        } else if (divider == "\\|") {
            this.childRelType = 2;
        } else {
            for (Feature f : this.children) {
                if (f.optional)
                    f.parentRelType = 2;
                else
                    f.parentRelType = 1;
            }
        }
    }

    public void setChild(Feature child){
        child.setParent(this);
        this.children.add(child);
    }

    public void setParent(Feature parent) {
        this.parent = parent;
    }

    public void setName(String name){ this.name = name; }

}

