            this.childRelType = 1;
        } else if (divider == "\\|") {
            this.childRelType = 2;
        } else {
            for (Feature f : this.children) {
                if (f.optional)
                    f.parentRelType = 2;
                else
                    f.parentRelType = 1;
            }
        }
    }

    public void setChild(Feature child){
        child.setParent(this);
        this.children.add(child);
    }

