import java.io.*;
import java.util.*;

class Point
{
	double x,y;
	public Point(double x, double y)
	{
		this.x = x;
		this.y = y;
	}
}

public class Main
{
	static PrintWriter writer = new PrintWriter(new OutputStreamWriter(System.out));
	public static void main(String [] args) throws IOException
	{
		BufferedReader reader = new BufferedReader(new InputStreamReader(System.in));
		while(true)
		{
			int n = Integer.parseInt(reader.readLine());
			if(n == 0)
				break;
			Point [] points = new Point[n];
			StringTokenizer st;
			for(int i = 0 ; i<n ; i++)
			{
				st = new StringTokenizer(reader.readLine());
				points[i] = new Point(Double.parseDouble(st.nextToken()), Double.parseDouble(st.nextToken()));
			}
			closestPair(points);
		}
		writer.flush();
		writer.close();
	}
	public static void closestPair(Point[] points) {
		Point[] closestPair = new Point[2];
		//When we start the min distance is the infinity
		double crtMinDist = Double.POSITIVE_INFINITY;

		//Get the points and sort them
		Point[] sorted = Arrays.copyOf(points, points.length);
		Arrays.sort(sorted, new Comparator<Point>()
		{
			@Override
			public int compare(Point a, Point b)
			{
				if (a.x < b.x) {
					return -1;
				}
				if (a.x > b.x) {
					return 1;
				}
				if (a.y < b.y) {
					return -1;
				}
				if (a.y > b.y) {
					return 1;
				}
				return 0;
			}
		});

		//When we start the left most candidate is the first one
		int leftMostCandidateIndex = 0;
		//Vertically sorted set of candidates
		SortedSet<Point> candidates = new TreeSet<Point>(new Comparator<Point>()
		{
			@Override
			public int compare(Point a, Point b)
			{
				if (a.y < b.y) {
					return -1;
				}
				if (a.y > b.y) {
					return 1;
				}
				if (a.x < b.x) {
					return -1;
				}
				if (a.x > b.x) {
					return 1;
				}
				return 0;
			}
		});
		//For each point from left to right
		for (Point current : sorted) {
			//Shrink the candidates
			while ( leftMostCandidateIndex < sorted.length && current.x - sorted[leftMostCandidateIndex].x < crtMinDist) {
				candidates.remove(sorted[leftMostCandidateIndex]);
				leftMostCandidateIndex++;
			}

			//Compute the y head and the y tail of the candidates set
			Point head = new Point(current.x,  (current.y - crtMinDist));
			Point tail = new Point(current.x,  (current.y + crtMinDist));

			//We take only the interesting candidates in the y axis
			for (Point point : candidates.subSet(head, tail)) {
				double distance = dis(current, point);

				//Simple min computation
				if (distance < crtMinDist) {
					crtMinDist = distance;

					closestPair[0] = current;
					closestPair[1] = point;
				}
			}

			//The current point is now a candidate
			candidates.add(current);
		}

		writer.printf("%.2f\n",dis(closestPair[0], closestPair[1])/2);
	}

	private static double dis(Point p1, Point p2)
	{
		return Math.sqrt((p1.x - p2.x)*(p1.x - p2.x) + (p1.y - p2.y)*(p1.y - p2.y));
	}
}

