class Case {
	private final int[] digits;
	private final int numOfDigits;
	private int minDigits = Integer.MAX_VALUE;

	Case(int[] digits) {
		this.digits = digits;
		this.numOfDigits = arraySum(digits);
	}

	public void evaluate() {
		f(0, new int[9], calcSum(new int[9]));
		System.out.println(minDigits == Integer.MAX_VALUE ? -1 : minDigits);
	}

	private void f(int index, int[] odd, int sum) {
		if (sum % 11 == 0) {
			int temp = countDigits(odd);
			if (temp < minDigits) {
				minDigits = temp;
			}
		}

		for (int i = index; i < digits.length; i++) {
			int temp = odd[i];
			for (int j = 0; j < digits[i]; j++) {
				odd[i]++;
				f(i + 1, odd, sum + 2 * (j + 1) * (i + 1));
			}
			odd[i] = temp;
		}
	}

	private int calcSum(int[] odd) {
		int sum = 0;
		for (int i = 0; i < digits.length; i++) {
			sum += (i + 1) * (2 * odd[i] - digits[i]);
		}
		return sum;
	}

	private int countDigits(int[] odd) {
		int oddSum = arraySum(odd);
		int evenSum = numOfDigits - oddSum;
		if (oddSum < evenSum)
			return 2 * evenSum;
		else if (oddSum > evenSum + 1)
			return 2 * oddSum - 1;
		else
			return oddSum + evenSum;
	}

	private int arraySum(int[] array) {
		int sum = 0;
		for (int i : array) {
			sum += i;
		}
		return sum;
	}
}

