/**
 * Implementation of the fourth coding assignment for the Algorithms course of
 * U of Tehran (Spring 2015): https://sharecode.io/section/utda/problem/1037
 * 
 * The code loosely follows Google Java Style guide:
 * https://google-styleguide.googlecode.com/svn/trunk/javaguide.html
 * using the following Eclipse formatter configuration:
 * https://google-styleguide.googlecode.com/svn/trunk/eclipse-java-google-style.xml
 */

import java.util.ArrayList;
import java.util.List;
import java.util.Scanner;

/**
 * Given an input network flow, finds an edge that if we double its capacity
 * then the total increase in the s-t flow is maximized.
 * 
 * @author Bashir Sadjad
 */
public class Main {
  private final List<NodeInfo> node_info_list;
  private static final int NOT_SET = -1;
  private final int source;
  private final int target;

  class NodeInfo {
    final List<EdgeInfo> edges = new ArrayList<EdgeInfo>();
    final int index;
    int parent;

    NodeInfo(int index) { this.index = index; }
  }

  enum EdgeDirection {
    INWARD,       // indicates an inward edge, i.e., an edge that ends in 'this'
    OUTWARD,      // indicates an outward edge, i.e., an edge that starts at 'this'
  }

  class EdgeInfo {
    public final int other_end;
    public final EdgeDirection direction;
    public int capacity;
    public int flow = 0;
    public int orig_flow = 0;
    public boolean is_cut_edge = false;

    public EdgeInfo(int other_end, int capacity, EdgeDirection direction) {
      this.other_end = other_end;
      this.capacity = capacity;
      this.direction = direction;
    }
  }

  public Main(int num_nodes) {
    node_info_list = new ArrayList<NodeInfo>();
    for (int i = 0; i < num_nodes; i++) node_info_list.add(new NodeInfo(i));
    source = 0;
    target = num_nodes - 1;
  }

  /**
   * Adds both directions of the edge to the network flow.
   * 
   * @param node_1 one end of the edge
   * @param node_2 the other end of the edge
   * @param capacity the capacity of the edge
   */
  public void AddEdge(int node_1, int node_2, int capacity) {
    node_info_list.get(node_1).edges.add(new EdgeInfo(node_2, capacity, EdgeDirection.OUTWARD));
    node_info_list.get(node_1).edges.add(new EdgeInfo(node_2, capacity, EdgeDirection.INWARD));
    node_info_list.get(node_2).edges.add(new EdgeInfo(node_1, capacity, EdgeDirection.INWARD));
    node_info_list.get(node_2).edges.add(new EdgeInfo(node_1, capacity, EdgeDirection.OUTWARD));
  }

  private void resetDfsTree() {
    for (NodeInfo node : this.node_info_list) {
      node.parent = NOT_SET;
    }
  }

  /**
   * @param root the root of the DFS sub-tree
   * @return the residual amount that can be increased or a number less than
   *         zero if there is no residual path to the target.
   */
  private int residualDfs(int root) {
    if (root == this.target) return Integer.MAX_VALUE;
    for (EdgeInfo edge : node_info_list.get(root).edges) {
      if (node_info_list.get(edge.other_end).parent != NOT_SET) continue;
      int edge_residual = -1;
      if (edge.direction == EdgeDirection.OUTWARD && edge.capacity > edge.flow)
        edge_residual = edge.capacity - edge.flow;
      if (edge.direction == EdgeDirection.INWARD && edge.flow > 0)
        edge_residual = edge.flow;
      if (edge_residual > 0) {
        node_info_list.get(edge.other_end).parent = root;
        int inc_amount = residualDfs(edge.other_end);
        if (inc_amount > 0) return Math.min(inc_amount, edge_residual);
      }
    }
    return -1;
  }

  private void updateEdgeFlow(int node_1, int node_2, EdgeDirection direction, int inc_amount) {
    for (EdgeInfo edge : node_info_list.get(node_1).edges) {
      if (edge.other_end == node_2 && edge.direction == direction) {
        edge.flow += inc_amount;
        assert edge.flow > 0;
      }
    }
  }

  private void updateResidualEdge(int node_1, int node_2, int inc_amount) {
    for (EdgeInfo edge : node_info_list.get(node_1).edges) {
      if (edge.other_end == node_2) {
        if (edge.direction == EdgeDirection.OUTWARD && edge.capacity - edge.flow >= inc_amount) {
          edge.flow += inc_amount;
          updateEdgeFlow(node_2, node_1, EdgeDirection.INWARD, inc_amount);
        } else if (edge.direction == EdgeDirection.INWARD && edge.flow >= inc_amount) {
          edge.flow -= inc_amount;
          updateEdgeFlow(node_1, node_2, EdgeDirection.OUTWARD, -inc_amount);
        } else {
          assert false; // should never reach here!
        }
      }
    }
  }

  private void increaseFlow(int inc_amount) {
    assert node_info_list.get(this.target).parent != NOT_SET;
    int current_node = this.target;
    while (current_node != this.source) {
      int previous_node = node_info_list.get(current_node).parent;
      updateResidualEdge(previous_node, current_node, inc_amount);
      current_node = previous_node;
    }
  }

  /**
   * This is the main function that constructs a valid maximum flow by repeated
   * calls to {@code residualDfs} and {@code increaseFlow}. This can start from
   * another valid flow that is not necessarily maximum and increment it until
   * it is maximum.
   */
  public void findMaxFlow() {
    int inc_amount = -1;
    do {
      inc_amount = -1;
      resetDfsTree();
      node_info_list.get(this.source).parent = 0;
      inc_amount = residualDfs(this.source);
      if (inc_amount > 0) {
        increaseFlow(inc_amount);
      }
    } while (inc_amount > 0);
  }

  /**
   * This calculates the amount of the current flow without making any changes
   * to it, so this usually follows a {@code findMaxFlow} call.
   * 
   * @return the total flow that goes out of this.source.
   */
  public int calculateTotalFlow() {
    int total_flow = 0;
    for (EdgeInfo edge : this.node_info_list.get(this.source).edges) {
      if (edge.direction == EdgeDirection.INWARD) assert edge.flow == 0;
      else total_flow += edge.flow;
    }
    return total_flow;
  }

  private void copyEdgeFlows() {
    for (NodeInfo node : node_info_list) {
      for (EdgeInfo edge : node.edges) edge.orig_flow = edge.flow;
    }
  }

  private void restoreOriginalEdgeFlows() {
    for (NodeInfo node : node_info_list) {
      for (EdgeInfo edge : node.edges) edge.flow = edge.orig_flow;
    }
  }

  private void updateEdgeCapacity(int node_1, int node_2, int new_capacity) {
    for (EdgeInfo edge : node_info_list.get(node_1).edges) {
      if (edge.other_end == node_2) {
        edge.capacity = new_capacity;
      }
    }
  }

  private void markCutEdges() {
    // The precondition for this function is that the max flow is already
    // calculated and the residual DFS tree is the last one.
    assert node_info_list.get(this.source).parent == this.source;
    assert node_info_list.get(this.target).parent == NOT_SET;
    for (NodeInfo node : this.node_info_list) {
      if (node.parent != NOT_SET) {
        for (EdgeInfo edge : node.edges) {
          if ((node_info_list.get(edge.other_end).parent == NOT_SET) &&
              (edge.direction == EdgeDirection.OUTWARD)) {
            edge.is_cut_edge = true;
          }
        }
      }
    }
  }

  /**
   * Finds the current maximum flow then for each edge of the minimum cut
   * tries doubling its capacity and recalculates the maximum flow. It chooses
   * the maximum among all tries.
   * 
   * @return the maximum achievable flow by doubling the capacity of an edge. 
   */
  public int findMaxFlowAfterIncrease() {
    findMaxFlow();
    int max_flow = calculateTotalFlow();
    // We keep the current flow to avoid recalculating it from scratch every
    // time that an edge capacity is doubled.
    copyEdgeFlows();

    // Check all edges of the cut and see if doubling the capacity helps
    // increasing the total flow.
    markCutEdges();
    for (NodeInfo node : this.node_info_list) {
      if (node.parent != NOT_SET) {
        for (EdgeInfo edge : node.edges) {

          // only check edges that are part of the cut
          if (!edge.is_cut_edge) continue;

          int old_capacity = edge.capacity;
          updateEdgeCapacity(node.index, edge.other_end, 2 * old_capacity);
          updateEdgeCapacity(edge.other_end, node.index, 2 * old_capacity);

          // Find the maximum flow after capacity increase.
          // Note that this continues from where the old findMaxFlow with
          // original capacities stopped to speed up.
          restoreOriginalEdgeFlows();
          findMaxFlow();
          int new_flow = calculateTotalFlow();
          if (new_flow > max_flow) max_flow = new_flow;

          updateEdgeCapacity(node.index, edge.other_end, old_capacity);
          updateEdgeCapacity(edge.other_end, node.index, old_capacity);
        }
      }
    }
    return max_flow;
  }

  public static void main(String[] args) {
    Scanner scanner = new Scanner(System.in);
    try {
      // There should be at least one integer indicating number of input cases.
      int num_cases = scanner.nextInt();
      int i = 0;
      for (i = 0; i < num_cases; i++) {
        int num_nodes = scanner.nextInt();
        int num_edges = scanner.nextInt();
        Main improver = new Main(num_nodes);
        for (int j = 0; j < num_edges; j++) {
          improver.AddEdge(scanner.nextInt(), scanner.nextInt(), scanner.nextInt());
        }
        improver.findMaxFlow();
        int current_max_flow = improver.calculateTotalFlow();
        int max_flow_after_increase = improver.findMaxFlowAfterIncrease();
        System.out.println(current_max_flow + " " + max_flow_after_increase);
      }
    } finally {
      scanner.close();
    }
  }  
}

