	static long knapSack(int[] weights, int W) {

		long[][] DP = new long[weights.length + 1][W + 1];

		DP[0][0] = 1L;
		for (int i = 0; i <= W; i++) {
			for (int j = 1; j <= weights.length; j++) {
				if (weights[j - 1] <= i) {
					int lI = j - 1;
					while (lI >= 0) {
						DP[j][i] += DP[j][i - weights[lI--]];
					}
				} else {
					DP[j][i] = DP[j - 1][i];
				}
			}
		}
		return DP[weights.length][W];
	}
