                    String[] equality = input.replace(" ", "").split("=");

                    parentName = equality[0];

                    for (String delimiter : new String[] {"+", "|", "^"})
                        if (equality[1].contains(delimiter))
                            featureType = FeatureType.typeOf(delimiter);

                    childrenNames = equality[1].split(featureType.getDelimiterAsRegex());
                } else
                    parentName = input;

                model.addFeature(parentName, featureType, childrenNames);
                input = scanner.nextLine();
            }
            input = scanner.nextLine();
            while(!input.equals("##")) {
                outputBuilder.append(
                        model.validate(parseWithComma(input)) ?
                                "Valid\n" :
                                "Invalid\n"
                );
                input = scanner.nextLine();
            }
            outputBuilder.append("+++\n");
            input = scanner.nextLine();
        }
        try {
            Thread.sleep(5000);
        } catch (InterruptedException ignore) {}
        System.out.print(outputBuilder);
    }

    private static List<String> parseWithComma(String testCase) {
        String[] names = testCase.replaceAll("[{}\\s]", "").split(",");
        return new LinkedList<>(Arrays.asList(names));
    }
}

abstract class AbstractParent extends Feature {
    List<Feature> children;

    AbstractParent(String name, AbstractParent parent, boolean isMandatory, List<Feature> children) {
        super(name, parent, isMandatory);
        this.children = children;
    }
}

class Feature {
    String name;
    private AbstractParent parent;
    boolean isMandatory;

    public boolean validate(List<String> test) {
        return !test.contains(this.name) || (this.parent == null || test.contains(this.parent.name));
    }

    Feature(String name) {
        this.name = name;
    }

    Feature(String name, AbstractParent parent, boolean isMandatory) {
        this.name = name;
        this.parent = parent;
        this.isMandatory = isMandatory;
    }

    void setParent(AbstractParent parent) {
        this.parent = parent;
    }

    void setMandatory(boolean mandatory) {
        this.isMandatory = mandatory;
    }

    public int hashCode() {
        return this.name.hashCode();
    }

    public boolean equals(Object obj) {
        return (obj instanceof Feature) &&
                this.name.equals(((Feature) obj).name);
    }

    AbstractParent toParent(FeatureType type, List<Feature> children) {
        AbstractParent grownMe = null;
        switch (type) {
            case SIMPLE:
                grownMe = new SimpleFeature(this.name, this.parent, this.isMandatory, children);
                break;
            case OR:
                grownMe =  new OrFeature(this.name, this.parent, this.isMandatory, children);
                break;
            case XOR:
                grownMe = new XorFeature(this.name, this.parent, this.isMandatory, children);
                break;
        }
        if (this.parent != null) { // this might be root
            this.parent.children.remove(this);
            this.parent.children.add(grownMe);
        }
        return grownMe;
    }
}

enum FeatureType {
    SIMPLE("+"),
    OR("|"),
    XOR("^");

    private final String delimiter;

    FeatureType(String delimiter) {
        this.delimiter = delimiter;
    }

    public String getDelimiterAsRegex() {
        return "\\" + this.delimiter;
    }

    public static FeatureType typeOf(String delimiter) {
        for (FeatureType featureType : FeatureType.values())
            if (delimiter.equals(featureType.delimiter))
                return featureType;
        return SIMPLE; // default, to get rid of NPE warnings
    }
}

class Model {
    private List<Feature> allFeatures = new LinkedList<>();
    private AbstractParent root = null;

    // only works if no feature appears more that once in the same side of the equality
    public void addFeature(String left, FeatureType type, String[] right) {
        List<Feature> children = new LinkedList<>();
        Feature toBeParent = new Feature(left);
        AbstractParent parent;

        int parentIdx = this.allFeatures.indexOf(toBeParent);
        if (parentIdx < 0) {
             parent = toBeParent.toParent(type, children);
             this.allFeatures.add(parent);
        } else {
            parent = this.allFeatures.remove(parentIdx).toParent(type, children);
            this.allFeatures.add(parent);
        }

        if (right != null) // for a possible singleton model
            for (String childName : right) {
                boolean mandatory = !childName.contains("?");
                childName = childName.replace("?", "");
                Feature toBeChild = new Feature(childName, parent, mandatory);
                int childIdx = this.allFeatures.indexOf(toBeChild);
                if (childIdx < 0) {
                    this.allFeatures.add(toBeChild);
                    children.add(toBeChild);
                } else {
                    Feature child = this.allFeatures.get(childIdx);
                    child.setParent(parent);
                    child.setMandatory(mandatory);
                    children.add(child);
                }
            }

        if (this.root == null) // this is the first time
            this.root = parent;
    }

    public boolean validate(List<String> test) {
        boolean result = test.contains(this.root.name);

        for (String testName : test) {
            Feature dummy = new Feature(testName);
            result &= this.allFeatures.contains(dummy);
        }

        if (this.allFeatures != null) {
            for (Feature feature : this.allFeatures)
                if (test.contains(feature.name))
                    result &= feature.validate(test);
        } else
            return false;

        return result;
    }
}

class OrFeature extends AbstractParent {
    OrFeature(String name, AbstractParent parent, boolean isMandatory, List<Feature> children) {
        super(name, parent, isMandatory, children);
    }

    public boolean validate(List<String> test) {
        for(Feature child : this.children)
            if (test.contains(child.name))
                return super.validate(test);
        return false;
    }
}


class SimpleFeature extends AbstractParent {
    SimpleFeature(String name, AbstractParent parent, boolean isMandatory, List<Feature> children) {
        super(name, parent, isMandatory, children);
    }

    public boolean validate(List<String> test) {
        if (this.children != null)
            for(Feature child : this.children)
                if (child.isMandatory && !test.contains(child.name))
                    return false;
        return super.validate(test);
    }
}

class XorFeature extends AbstractParent {
    XorFeature(String name, AbstractParent parent, boolean isMandatory, List<Feature> children) {
        super(name, parent, isMandatory, children);
    }

    public boolean validate(List<String> test) {
        boolean oneChildSeen = false;
        for (Feature child : this.children)
            if (test.contains(child.name))
                if (oneChildSeen)
                    return false;
                else
                    oneChildSeen = true;
        return oneChildSeen && super.validate(test);
    }
}

